INSERT INTO z_export (id, rootname, naam, variant, merk, omschrijving, nprijs, prijs, jnr, jnr2, aantal, groep) VALUES (41, '47375', 'Perception', 'Laser Black Lenzen-Titanium Frame', 'Rudy Project', 'De Perception is al jaren het toonbeeld van het succes van een sportieve bril met correctie glazen. Een comfortabele Rudy Project voorzien van de Rudy Project kwaliteits kenmerken; 360° instelbare oorrubbers, instelbare neusrubbbers en verwisselbare lenzen. Maar ook de mogelijkheid voor een Elastic Strap, Flip-Up zonnebril lenzen en standaard (verwijderbare) Clip-On completeren het model tot een absolute topper in zijn segment. ', '', '154,90', 'SN420992', 'SN420992', 1, 'RX-Brillen');
