INSERT INTO z_export (id, rootname, naam, variant, merk, omschrijving, nprijs, prijs, jnr, jnr2, aantal, groep) VALUES (41, '47377', 'Perception', 'Laser Brown Lenzen-Brown Velvet Frame', 'Rudy Project', 'De Perception is al jaren het toonbeeld van het succes van een sportieve bril met correctie glazen. Een comfortabele Rudy Project voorzien van de Rudy Project kwaliteits kenmerken; 360° instelbare oorrubbers, instelbare neusrubbbers en verwisselbare lenzen. Maar ook de mogelijkheid voor een Elastic Strap, Flip-Up zonnebril lenzen en standaard (verwijderbare) Clip-On completeren het model tot een absolute topper in zijn segment. ', '', '154,90', 'SN424620', 'SN424620', 0, 'RX-Brillen');
INSERT INTO z_export (id, rootname, naam, variant, merk, omschrijving, nprijs, prijs, jnr, jnr2, aantal, groep) VALUES (42, '47365', 'Exception STD', 'Laser Black Lenzen-Matte Black Frame', 'Rudy Project', '<p>Veelzijdig, comfortabel, slank en voorzien van RX mogelijkheden. Een echte baanbrekende visie van Rudy Procject.</p><p> De Exception brengt een veelzijdig aanbod aan mogelijkheden samen in een technologisch design. Gebaseerd op het succes van de designs van Rudy (Ketyum, Rydon (II)) en de revolutionaire Flip-Up technologie (RB3, Perception en Kabrio) maken de Exception een designers meesterwerk dat alle grootte technologieën van Rudy Project combineert in één superieur model.</p><p> De Rudy Project lenzen kunnen direct in het frame worden geplaatst of in combinatie met de meegeleverde RX Clip-On in de handige meegeleverde Flip-up die aan het frame kan worden bevestigd. Hierdoor biedt de Exception veel mogelijkheden voor elke gebruiker in elke situatie. Daarnaast is de Exception uiteraard voorzien van 360° instelbare oorrubbers, instelbare neusrubbbers en verwisselbare lenzen. </p><p>
