INSERT INTO z_export (id, rootname, naam, variant, merk, omschrijving, nprijs, prijs, jnr, jnr2, aantal, groep) VALUES (130, '236', 'Front Roller Classic', 'Geel', 'Ortlieb', '<div class="product_tekst">Ze vervullen een voortrekkersrol als het gaat om het meenemen van bagage op de fiets in het algemeen: de ORTLIEB Front-Roller. Deze twee uitvoeringen werden de afgelopen jaren niet alleen intensief door outdoor- en vaktijdschriften getest en zonder uitzondering aanbevolen, maar ook over de hele wereld door ambitieuze fietsers op alle mogelijke manieren op de proef gesteld. <br />Rechts en links aan zowel het voor- als achterwiel transporteert u uw bagage goed verdeeld en optimaal beschermd. Het robuuste materiaal kan heel wat hebben en biedt ondanks het extreem lage eigengewicht voldoende opbergruimte, niet alleen voor fietstochten maar ook voor dagelijks gebruik in uw eigen omgeving. De hermetische rolsluitingen, de schouderriem en het ORTLIEB Quick-Lock-systeem zijn h&eacute;t bewijs, dat ongecompliceerde oplossingen vaak de meest bruikbare zijn. Geheel nieuw in 2007: alle modellen zijn uitgevoerd met een ge&iuml;ntegreerd binnenvak! <br /><br />Front-Roller Classic<br />&bull; Geschikt voor kinderfietsen<br />&bull; Voor Lowrider-dragers aan het voorwiel of bagagedragers aan het achterwiel <br />&bull; Van polyester weefsel<br />&bull; Quick-Lock1-bevestigingssysteem<br />&bull; Reflectoren<br /><br />Overig aanbevolen toebehoren: <br />Fietstassen-draagsysteem, buitentassen maat S,<br /><br />Informatie:<br />De Back- en Front-Roller kunnen met de ORTLIEB Rack-Pack op de bagagedrager van het achterwiel worden gecombineerd. Zo kunnen ook tent, slaapzak en isomatje mee - en wel waterdicht. <br /><table border="0" cellspacing="0" cellpadding="0"><tbody><tr><td class="variaties" colspan="5"><strong>Maten </strong>(Maten en gewicht per stuk, inhoud p. set)</td></tr><tr><td width="60"><div class="groep_product">Hoogte </div><div class="groep_maattabel">30 cm </div></td><td width="60"><div class="groep_product">Breedte</div><div class="groep_maattabel">25 cm </div></td><td width="60"><div class="groep_product">Diepte</div><div class="groep_maattabel">14 cm </div></td><td width="60"><div class="groep_product">Gewicht</div><div class="groep_maattabel">670 g</div></td><td width="60"><div class="groep_product">Inhoud</div><div class="groep_maattabel">25&nbsp;L </div></td></tr></tbody></table></div>', '', '94,95', '40024', '40024', 5, '(Fiets) Voortassen ');
