INSERT INTO z_export (id, rootname, naam, variant, merk, omschrijving, nprijs, prijs, jnr, jnr2, aantal, groep) VALUES (136, '261', 'Bike Packer Plus', 'Zwart', 'Ortlieb', '<div class="product_tekst">De Bike-Packer Plus, die per 2 stuks met 40 l inhoud weet te overtuigen. Ook deze tas is in de Plus-variant uitgevoerd met een extra buitenvak met netstof. Geheel nieuw in het jaar 2007 is het ge&iuml;ntegreerde binnenvak in al onze modellen voor nog meer transportcomfort. </div><div class="product_tekst">Bike-Packer Plus<br />&bull; Achtertas van Cordura-weefsel<br />&bull; Quick-Lock2-bevestigingssysteem<br />&bull; Buitenvak van netstof met ritssluiting<br />&bull; Beschermplaat tegen het schuren aan de achterkant met uitsparingen voor het gebruik van extra drukbanden (drukbanden als toebehoren verkrijgbaar)<br />&bull; Drukbanden en stevige steekgespen om veilig en goed af te sluiten </div><p class="product_tekst">Overig aanbevolen toebehoren: <br />Fietstassen-draagsysteem, buitentassen maat S, diefstalbeveiliging</p><p class="product_tekst">Informatie: Alle modellen zijn voorzien van grote reflectoren en een praktisch handvat.</p><div class="product_tekst"><table border="0" cellspacing="0" cellpadding="0"><tbody><tr><td class="variaties" colspan="5"><strong>Maten</strong> (inhoud en gewicht per set)</td></tr><tr><td width="60"><div class="groep_product">Hoogte </div><div class="groep_maattabel">42 cm </div></td><td width="60"><div class="groep_product">Breedte</div><div class="groep_maattabel">23/32 cm </div></td><td width="60"><div class="groep_product">Diepte</div><div class="groep_maattabel">17 cm </div></td><td width="60"><div class="groep_product">Gewicht</div><div class="groep_maattabel">1950 g</div></td><td width="60"><div class="groep_product">Inhoud</div><div class="groep_maattabel">40 L </div></td></tr></tbody></table></div>', '159,95', '124,95', '41032', '41032', 6, NULL);
