INSERT INTO z_export (id, rootname, naam, variant, merk, omschrijving, nprijs, prijs, jnr, jnr2, aantal, groep) VALUES (138, '266', 'Office Bag', 'M Zwart', 'Ortlieb', '<p>Opdat de belangrijkste benodigdheden veilig op de werkplek aankomen, zit de Office-Bag veilig en vast op alle standaard bagagedragers tot 16 mm diameter. Het Quick-Lock2-systeem is bij deze aktetas diagonaal aangebracht en draaibaar - voor meer pedaalvrijheid rechts en links. Bij bevestiging aan de rechterkant van de bagagedrager, de buitenste schroeven van de rail losdraaien, blinde stoppen aan de achterkant van de tas verwijderen, rails draaien en met schroeven weer vastzetten. Daarna de blinde stoppen in de niet-gebruikte gaten steken. De verschuif- en vergrendlingshaak beschermt de Office-Bag tegen opzij zwenken. Bij het fietsen de schouderriem eerst in de tas opbergen.<br /><br />Overige praktische details: <br />&bull; Bescherming tegen scherpe kanten aan de achterzijde van de tas<br />&bull; Pootjes<br />&bull; Organizer in A4-formaat met vakje voor een mobiele telefoon, sleutelhanger en verschillende handige insteekvakken<br />&bull; Handvat<br />&bull; Reflectoren rechts en links</p>', '', '94,95', '44046', '44046', 2, '(Fiets) Achtertassen');
