INSERT INTO z_export (id, rootname, naam, variant, merk, omschrijving, nprijs, prijs, jnr, jnr2, aantal, groep) VALUES (139, '269', 'Travel Biker', 'Zwart', 'Ortlieb', '<div class="product_tekst">Voor iedereen, die door de reiskoorts wordt gepakt. De super praktische Travel-Biker is gespecialiseerd op het transport van omvangrijke garderobes. Zelfs de meest chique outfit komt kreukvrij aan. En dat is te danken aan de doordachte indeling met binnenvakken, 3 nettasjes met ritssluiting en 2 drukbanden. Ook van buiten slaat de waterdichte Travel-Biker een goed figuur: het klassieke design, het lage gewicht en de eenvoudige hantering fascineren telkens weer opnieuw. In een handomdraai wordt de koffer op de meegeleverde bagagedrager-adapter vastgeklikt. Op het kofferdeksel kan fietskleding onder het spanelastiek worden meegenomen. Dankzij de afneembare, zacht beklede schouderdraagriem is de Travel-Biker ook zonder fiets een handig transportmiddel. De schouderriem is individueel aan te passen. De Travel-Biker is ideaal voor geveerde trekking- en tourfietsen en ook geschikt voor zadelpenbagagedragers. <p>Overige praktische details: <br />&bull; TIZIP-ritssluiting<br />&bull; Zacht bekleed, afneembaar handvat<br />&bull; Te combineren met alle ORTLIEB fietstassen <br />&bull; Bagagedrager-adapter ook los verkrijgbaar, opdat de koffer ook op andere fietsen kan worden omgezet. </p></div>', '', '149,95', '44002', '44002', 0, '(Fiets) Achtertassen');
INSERT INTO z_export (id, rootname, naam, variant, merk, omschrijving, nprijs, prijs, jnr, jnr2, aantal, groep) VALUES (139, '270', 'Travel Biker', 'Graphite', 'Ortlieb', '<div class="product_tekst">Voor iedereen, die door de reiskoorts wordt gepakt. De super praktische Travel-Biker is gespecialiseerd op het transport van omvangrijke garderobes. Zelfs de meest chique outfit komt kreukvrij aan. En dat is te danken aan de doordachte indeling met binnenvakken, 3 nettasjes met ritssluiting en 2 drukbanden. Ook van buiten slaat de waterdichte Travel-Biker een goed figuur: het klassieke design, het lage gewicht en de eenvoudige hantering fascineren telkens weer opnieuw. In een handomdraai wordt de koffer op de meegeleverde bagagedrager-adapter vastgeklikt. Op het kofferdeksel kan fietskleding onder het spanelastiek worden meegenomen. Dankzij de afneembare, zacht beklede schouderdraagriem is de Travel-Biker ook zonder fiets een handig transportmiddel. De schouderriem is individueel aan te passen. De Travel-Biker is ideaal voor geveerde trekking- en tourfietsen en ook geschikt voor zadelpenbagagedragers. <p>Overige praktische details: <br />&bull; TIZIP-ritssluiting<br />&bull; Zacht bekleed, afneembaar handvat<br />&bull; Te combineren met alle ORTLIEB fietstassen <br />&bull; Bagagedrager-adapter ook los verkrijgbaar, opdat de koffer ook op andere fietsen kan worden omgezet. </p></div>', '', '149,95', '44025', '44025', NULL, '(Fiets) Achtertassen');
INSERT INTO z_export (id, rootname, naam, variant, merk, omschrijving, nprijs, prijs, jnr, jnr2, aantal, groep) VALUES (140, '271', 'Bike Shopper', 'Zwart Ql2', 'Ortlieb', 'Ideaal voor de dagelijkse boodschappen wordt de ruime markt- en boodschappentas in een handomdraai met het Quick-Lock2-systeem aan de bagagedrager bevestigd. De ellipsvormige haakrails, de draaibare vergrendelingshaak en de randbescherming met sleuven voor het ORTLIEB draagsysteem garanderen stabiliteit met de volgeladen Bike-Shopper op hobbelige wegen. De draagriemen zijn in de lengte verstelbaar, d.w.z. dat de tas comfortabel over de schouder kan worden gedragen. De tas wordt gesloten met de QSC-Quick-Seal-afdichtingslip, die gegarandeerd waterdicht is en de boodschappen ook bij regen droog houdt. Op de fiets worden de riemen op de kortste lengte met drukknopen vastgezet. Om de sluiting langdurig soepel te houden, regelmatig met glijmiddel insmeren. <p>Overige praktische details:<br />&bull; Binnenvak voor waardevolle spullen<br />&bull; Zacht bekleed handvat &bull; 3M-Scotchlite-reflectoren aan beide zijden<br />&bull; Diefstalbeveiliging en buitentas als toebehoren los verkrijgbaar </p>', '', '74,95', '44015', '44015', NULL, '(Fiets) Achtertassen');
