INSERT INTO z_export (id, rootname, naam, variant, merk, omschrijving, nprijs, prijs, jnr, jnr2, aantal, groep) VALUES (140, '274', 'Bike Shopper', 'Zilver Ql2', 'Ortlieb', 'Ideaal voor de dagelijkse boodschappen wordt de ruime markt- en boodschappentas in een handomdraai met het Quick-Lock2-systeem aan de bagagedrager bevestigd. De ellipsvormige haakrails, de draaibare vergrendelingshaak en de randbescherming met sleuven voor het ORTLIEB draagsysteem garanderen stabiliteit met de volgeladen Bike-Shopper op hobbelige wegen. De draagriemen zijn in de lengte verstelbaar, d.w.z. dat de tas comfortabel over de schouder kan worden gedragen. De tas wordt gesloten met de QSC-Quick-Seal-afdichtingslip, die gegarandeerd waterdicht is en de boodschappen ook bij regen droog houdt. Op de fiets worden de riemen op de kortste lengte met drukknopen vastgezet. Om de sluiting langdurig soepel te houden, regelmatig met glijmiddel insmeren. <p>Overige praktische details:<br />&bull; Binnenvak voor waardevolle spullen<br />&bull; Zacht bekleed handvat &bull; 3M-Scotchlite-reflectoren aan beide zijden<br />&bull; Diefstalbeveiliging en buitentas als toebehoren los verkrijgbaar </p>', '', '74,95', '44030', '44030', NULL, '(Fiets) Achtertassen');
INSERT INTO z_export (id, rootname, naam, variant, merk, omschrijving, nprijs, prijs, jnr, jnr2, aantal, groep) VALUES (141, '275', 'Shuttle Bike', 'Zilver', 'Ortlieb', 'De sportspullen moeten mee, de favoriete jeans sowieso, maar ook wat chics voor &lsquo;s avonds mag niet ontbreken. De stevige trolley met gewatteerde binnenbekleding transporteert uw garderobe gegarandeerd kreukvrij. De kruisspanbanden plus een uitknoopbaar tussenschot van netstof houden alle kledingstukken netjes op hun plaats. Twee binnenzijvakken bieden plaats aan accessoires en losse spullen. Het vlotte uiterlijk, de licht lopende wieltjes en het feit dat u het aanbrengen en losmaken in een mum van tijd voor elkaar heeft, maken van de Shuttle-Bike een uiterst professionele begeleider. Voor grotere fietstochten is de Shuttle-Bike probleemloos met zijtassen of de Tour-Box te combineren. <p>Overige praktische details:<br />&bull; Uitschuifbare telescoopgreep; aan de aluminium stangen kunnen nog meer tassen worden bevestigd <br />&bull; Cijferslot<br />&bull; Inclusief ORTLIEB bagagedrager-adapter met frame voor het aanhangen van fietstassen<br />&bull; Verkrijgbaar toebehoren: rugdraagsysteem en foto-inzet</p><p>INFO: Alle koffers zijn gemaakt van onbreekbaar polycarbonaat. Dit materiaal is stootvast, extreem belastbaar en beschermt tegen vocht en vuil. Bovendien zijn de Tour-Box, Office-Bag2 en Shuttle-Bike voorzien van de waterdichte, afsluitbare TIZIP-ritssluiting. </p>', '', '179,95', '44035', '44035', NULL, '(Fiets) Achtertassen');
