INSERT INTO z_export (id, rootname, naam, variant, merk, omschrijving, nprijs, prijs, jnr, jnr2, aantal, groep) VALUES (146, '6906', 'Sling It', 'M Graphite', 'Ortlieb', 'Hangt als een klit aan je lijf - die tas van jou - wat er ook staat te gebeuren. Want de tas neemt alles onder zijn hoede wat hem wordt toevertrouwd. Maar dankzij het klittenband op de stevige overslagklep is de inhoud makkelijk toegankelijk. De brede en zachte bekleding op de draagriem ontziet de schouder. Met een afneembare gordel tijdens het fietsen op de rug draagbaar. Kortom: Sling-It denkt mee. Dat geldt ook voor de praktische indeling: een bekleed binnenvak met klittenband voor het notebook, nog een groot binnenvak voor de &quot;halve huishouding&quot;, twee -binnenvakken met ritslsuiting - waarvan &eacute;&eacute;n met onderverdeling voor pennen, gsm &amp; co. Sling-It is in maat S (voor kleinere laptops) en M (voor laptops tot 15&quot; beeldscherm) verkrijgbaar. <p>Overige praktische details:<br />&bull; Karabijnhaak aan de binnenkant voor sleutels <br />&bull; Schouderriem en heupgordel verstelbaar</p>', '', '104,95', '48066', '48066', 0, 'Schoudertassen');
