INSERT INTO z_export (id, rootname, naam, variant, merk, omschrijving, nprijs, prijs, jnr, jnr2, aantal, groep) VALUES (147, '361', 'Zip City', 'S Zilver', 'Ortlieb', 'Pakken, zippen, omhangen en wegwezen. De markante koerier-look, de grote inhoud en de ruime keuze aan trendy kleuren verraden het individuele, facettenrijke bestaan van de typische&nbsp;Zip-City drager. Je komt ze tegen in scholen, universiteiten, winkelcentra en sportscholen, in het nachtleven, maar ook in het beroepsleven. Zo is de Zip-City bijvoorbeeld ook zeer populair als DJ-tas. Verkrijgbaar in de maten S en M. <p>Overige praktische details: <br />&bull; Waterdichte TIZIP ritssluiting<br />&bull; Binnenvak voor pennen, gsm, papieren &amp; co. Standaarduitvoering in maat M - als toebehoren verkrijgbaar in maat S<br />&bull; Extra riem om de tas comfortabel op de rug te dragen <br />&bull; In de levering: glijmiddel voor de TIZIP-ritssluiting </p>', '', '74,95', '48002', '48002', 0, 'Schoudertassen');
