INSERT INTO z_export (id, rootname, naam, variant, merk, omschrijving, nprijs, prijs, jnr, jnr2, aantal, groep) VALUES (150, '375', 'Koerierstas', ' Zilver', 'Ortlieb', 'De rolsluiting met klittenband is snel en eenvoudig te bedienen en maakt de pakhoogte flexibel. De brede buikgordel en de borstgordel houden de tas dicht tegen het lichaam. De grote reflectoren aan de zijkant en op de schouderriemen zijn een veiligheidspluspunt voor de ochtendstond resp. avondschemering. De koeriertas in de collectie van 2008 beschikt over een aantal nieuwe details. Zo heeft deze tas een transporthandvat, een geoptimaliseerde bevestiging voor een (veiligheids)riem, een achterkant van schuim wat zorgt voor betere ventilatie en een verstevigde onderkant met hoekbeschermers en noppen zodat de tas rechtop kan blijven staan. <br /><br />Als zinvol toebehoren verkrijgbaar: <br />&bull; Klittenbandverlenging voor bovenmaatse zendingen <br />&bull; Binnenverdeling A3-formaat<br />&bull; Organizer (stevig documentenvak)<br />&bull; Binnentas resp. gordeltasje met steekvakken voor pennen, plattegronden, vrachtbonnen enz. (niet waterdicht)', '', '104,95', '48510', '48510', NULL, 'Rugzakken');
