INSERT INTO z_export (id, rootname, naam, variant, merk, omschrijving, nprijs, prijs, jnr, jnr2, aantal, groep) VALUES (153, '384', 'Packman Pro', ' Zwart', 'Ortlieb', 'Wie een dag in de openlucht doorbrengt, kan genieten van zowel de schoonheid als de grilligheid van de natuur! Packman Pro heeft ook dan een duidelijke functie: alles wat hij transporteert moet droog blijven. Voor een dagrugzak is de opbergruimte verrassend groot. Door de praktische rolsluiting is de pakhoogte steeds variabel. Alle draagcomponenten kunnen individueel worden aangepast. Dat geldt niet alleen voor de borst- en heupgordel, maar ook voor de ergonomische schouderriemen en het rugdraagsysteem. <br /><br />Overige praktische details: <br />&bull; Buitenvak met fietshelmbevestiging (niet waterdicht)<br />&bull; Reflector', '', '104,95', '47007', '47007', 1, 'Rugzakken');
