INSERT INTO z_export (id, rootname, naam, variant, merk, omschrijving, nprijs, prijs, jnr, jnr2, aantal, groep) VALUES (156, '978', 'Draagsysteem Fototassen', '', 'Ortlieb', 'In de natuur is de waardevolle uitrusting, vooral voor profs, hun kostbaarste bezit. Dan is het een rustgevend en veilig gevoel wanneer je alles dicht bij je hebt. En de beste snapshots kunnen sowieso alleen ontstaan, wanneer de camera altijd voor het grijpen is. Ook bergbeklimmers en kanovaarders hebben met het ongecompliceerde draagsysteem van alle ORTLIEB fototassen zo dicht op het lichaam de handen vrij.<br /><br />Overige praktische details:<br />&bull; 3-standen-gespen voor een flexibele instelling op de lichaamsgrootte <br />&bull; Karabijnhaken voor snelle en universele bevestiging<br />&bull; Compacte tas in nylon hoes (niet waterdicht)', '', '18,95', '46012', '46012', 1, 'Accessoires');
INSERT INTO z_export (id, rootname, naam, variant, merk, omschrijving, nprijs, prijs, jnr, jnr2, aantal, groep) VALUES (157, '977', 'Ultimate Foto Inzet', '', 'Ortlieb', 'Voor iedereen, die zijn camera-uitrusting of verrekijker veilig en beschermd binnen handbereik willen houden. De beklede foto-inzet van nylon wordt in de Ultimate2-5 modellen (M en L) geplaatst en maakt van de stuurtas een professionele fototas, waarin de foto-, video- of optische uitrusting perfect kan worden ondergebracht. Ook inzetbaar in de ORTLIEB Hip-Pack.<br /><br />Praktische details:<br />&bull; Variabele indeling<br />&bull; Verstevigde bodem ', '', '19,95', '46013', '46013', 5, 'Accessoires');
INSERT INTO z_export (id, rootname, naam, variant, merk, omschrijving, nprijs, prijs, jnr, jnr2, aantal, groep) VALUES (158, '976', 'Aqua Cam M', '', 'Ortlieb', 'Voor avonturiers van het zuiverste water. En daar is de Aqua-Cam er eentje van: de ruime en waterdichte fototas voor foto- en video-uitrustingen en ideale behuizing voor de camcorder. Twee maten en de uitneembare, beklede foto-inzet met versteviging bieden individueel plaats en bescherming voor uitrusting en toebehoren. Met schouderriem of aan de ge&iuml;ntegreerde riemlus wordt de tas direct op het lichaam gedragen of gecombineerd met het comfortabele draagsysteem voor fototassen (extra toebehoren). Om alles bij de hand te hebben.<br /><br />Overige praktische details:<br />&bull; Quick-Seal-sluiting<br />&bull; Eenvoudig en snel te bedienen grendelsluiting &bull; 4-richtingen-lussen aan de achterkant om aan een riem te bevestigen<br />&bull; Wattering als betrouwbare bescherming tegen mechanische beschadiging<br />&bull; 4-punts-bevestiging aan het lichaam mogelijk met D-ringen<br />&bull; Zacht beklede, verstelbare schouderriem met karabijnhaak<br />&bull; Met behulp van D-ringen te combineren met fototassen-draagsysteem (apart bijbestellen a.u.b.)', '', '79,95', '46015', '46015', NULL, 'Foto tassen');
INSERT INTO z_export (id, rootname, naam, variant, merk, omschrijving, nprijs, prijs, jnr, jnr2, aantal, groep) VALUES (159, '975', 'Aqua Zoom', '', 'Ortlieb', '', '', '74,95', '46016', '46016', 0, 'Foto tassen');
INSERT INTO z_export (id, rootname, naam, variant, merk, omschrijving, nprijs, prijs, jnr, jnr2, aantal, groep) VALUES (160, '974', 'Protect', '', 'Ortlieb', 'Protect is de handzame, rechthoekige tas voor compacte en digitale camera&rsquo;s, GPS en handhelds en kleine verrekijkers en kan direct op het lichaam worden gedragen - als schoudertas aan de riem (maximaal 30 cm breed) of gecombineerd met het praktische draagsysteem voor fototassen (extra toebehoren). Dankzij de waterdichte Quick-Seal-sluiting snel toegankelij; de sluiting biedt de apparatuur tegelijkertijd een optimale bescherming tegen vuil en vocht.<br /><br />Overige praktische details:<br />&bull; Quick-Seal-sluiting<br />&bull; Eenvoudig en snel te bedienen grendelsluiting<br />&bull; 4-richtingen-lussen om horizontaal of verticaal aan een riem te bevestigen of met gespen aan andere tassen <br />&bull; Wattering als betrouwbare bescherming tegen mechanische beschadiging <br />&bull; 4-punts-bevestiging aan het lichaam mogelijk met D-ringen<br />&bull; Verstelbare schouderriem met karabijnhaak<br />&bull; Te combineren met fototassen-draagsysteem (apart bijbestellen a.u.b.)', '', '49,95', '46017', '46017', 0, 'Foto tassen');
