INSERT INTO z_export (id, rootname, naam, variant, merk, omschrijving, nprijs, prijs, jnr, jnr2, aantal, groep) VALUES (167, '995', 'Fietstas Draagsysteem', '', 'Ortlieb', 'Flexibiliteit mee op reis - het draagsysteem maakt van de fietstas tevens een rugzak. Het rugpand is met alle ORTLIEB fietstassen met Quick-Lock1- en Quick-Lock2-bevestigingssysteem te combineren. Zoals u dat van ons gewend bent, biedt ORTLIEB optimaal comfort, want het ademende draagsysteem zorgt ervoor dat de lucht kan circuleren. Het thermogevormde rugpand, de gewatteerde, verstelbare draagriemen en de borstgordel garanderen een aangenaam draagcomfort. Om de fietstas op de rug te kunnen dragen, wordt het draagsysteem met de Quick-Lock-bevestiging aan de D-ringen vastgehaakt en vanonder met een klem vast in de randgleuven gedrukt. Licht van gewicht en ruimtebesparend. Geschikt voor Front- en Back-Roller (vanaf 1995), Bike-Packer (vanaf 1996), Sport-Packer, Bike-Tourer en Bike-Shopper. <p>Overige praktische details: <br />&bull; Handvat<br />&bull; Reflecterende stiksels</p>', '', '32,955', '44007', '44007', 3, 'Accessoires');
INSERT INTO z_export (id, rootname, naam, variant, merk, omschrijving, nprijs, prijs, jnr, jnr2, aantal, groep) VALUES (168, '996', 'Kaartleesmap Stuurtassen', '', 'Ortlieb', '<p>Steeds de route voor ogen te hebben, geeft vooral op langere afstanden een gevoel van zekerheid. De ORTLIEB kaartentas wordt met drukknopen aan de stuurtas bevestigd. Voor alle Ultimate2-5-stuurtassen (maat M en L).</p><p>Praktische details:<br />&bull; Omkeer- en vouwbaar<br />&bull; Binnenafmeting 27 x 27 cm</p>', '', '16,965', '44009', '44009', 14, 'Accessoires');
INSERT INTO z_export (id, rootname, naam, variant, merk, omschrijving, nprijs, prijs, jnr, jnr2, aantal, groep) VALUES (169, '997', 'QL2 Slotkabel Kort', '', 'Ortlieb', 'Van een kleine wandeling of een korte eetpauze geniet je meer zonder bagage! Geen probleem - de borgkabel beschermt de fiets- en motortassen met behulp van de voorhanden zijnde beugel- kabelsloten veilig en zeker tegen diefstal. De kabel is in twee lengtes verkrijgbaar, voor korte en lange Quick-Lock2-rails.<br /><br />&bull; Kunststof plaatje ter bevestiging van de kabel bij niet-gebruik', '', '9,945', '44011', '44011', 6, 'Accessoires');
INSERT INTO z_export (id, rootname, naam, variant, merk, omschrijving, nprijs, prijs, jnr, jnr2, aantal, groep) VALUES (170, '998', 'QL2 Slotkabel Lang', '', 'Ortlieb', 'Van een kleine wandeling of een korte eetpauze geniet je meer zonder bagage! Geen probleem - de borgkabel beschermt de fiets- en motortassen met behulp van de voorhanden zijnde beugel- kabelsloten veilig en zeker tegen diefstal. De kabel is in twee lengtes verkrijgbaar, voor korte en lange Quick-Lock2-rails.<br /><br />&bull; Kunststof plaatje ter bevestiging van de kabel bij niet-gebruik', '', '9,945', '44012', '44012', 6, 'Accessoires');
INSERT INTO z_export (id, rootname, naam, variant, merk, omschrijving, nprijs, prijs, jnr, jnr2, aantal, groep) VALUES (171, '999', 'Verlengadapter Ultimate 5', '', 'Ortlieb', 'Ook aan sterk gebogen comfort-sturen zoals Modolo of Humpert kan de Ultimate-stuurtas worden aangebracht. Speciaal hiervoor werd de verlengadapter ontwikkeld, die tussen montageblok en stuur wordt geplaatst. Alleen in combinatie met de afsluitbare Ultimate4- en 5-montageblokken bruikbaar.<br /><br />In de levering inbegrepen: <br />&bull; Extra lang bevestigingskoord <br />&bull; Montagebeschrijving', '', '9,95', '44014', '44014', 12, 'Accessoires');
INSERT INTO z_export (id, rootname, naam, variant, merk, omschrijving, nprijs, prijs, jnr, jnr2, aantal, groep) VALUES (172, '1000', 'Buitentas Small', '', 'Ortlieb', 'De veelzijdige, afneembare buitentas transporteert belangrijke spullen van portemonnee tot drinkfles en EHBO-set. Met rolsluiting en dankzij het klemmechanisme snel en eenvoudig aan de fietstas te bevestigen. Getest en onderscheiden door het tijdschrift RADtouren kan deze praktische begeleider bovendien direct aan de riem worden gedragen. Maat S met reflector is geschikt voor alle ORTLIEB fietstassen en maat L past aan alle grotere rugzakken. <br /><br />Overige praktische details:<br />&bull; Binnenversteviging<br />&bull; Inclusief 1 bevestigingsset (extra bevestigingsset los verkrijgbaar)', '', '26,95', '44017', '44017', 3, 'Accessoires');
INSERT INTO z_export (id, rootname, naam, variant, merk, omschrijving, nprijs, prijs, jnr, jnr2, aantal, groep) VALUES (173, '1001', 'Buitentas Large (Rugzak)', '', 'Ortlieb', 'De veelzijdige, afneembare buitentas transporteert belangrijke spullen van portemonnee tot drinkfles en EHBO-set. Met rolsluiting en dankzij het klemmechanisme snel en eenvoudig aan de fietstas te bevestigen. Getest en onderscheiden door het tijdschrift RADtouren kan deze praktische begeleider bovendien direct aan de riem worden gedragen. Maat S met reflector is geschikt voor alle ORTLIEB fietstassen en maat L past aan alle grotere rugzakken. <br /><br />Overige praktische details:<br />&bull; Binnenversteviging<br />&bull; Inclusief 1 bevestigingsset (extra bevestigingsset los verkrijgbaar)', '', '32,95', '44018', '44018', 6, 'Accessoires');
