INSERT INTO z_export (id, rootname, naam, variant, merk, omschrijving, nprijs, prijs, jnr, jnr2, aantal, groep) VALUES (181, '49101', 'Paardentas', '', 'Ortlieb', 'Outdoor-avonturen met zijn twee&euml;n zijn het mooist, wanneer de partners harmoni&euml;ren en op elkaar zijn ingespeeld. Ook wanneer de partner vier benen heeft en bereid is verantwoording te dragen. De ORTLIEB zadeltassen maken het voor paard en ruiter op de gezamenlijke tocht zo eenvoudig mogelijk. De tassen van afwasbaar, slijt- en scheurvast weefstel zijn makkelijk te bevestigen aan lange afstand-, trekking-, military-, western-, en universele zadels. Van gelast, waterdicht materiaal, met dekselsluiting en sneeuwklep met tunnelkoordje bieden ze optimale bescherming tegen vocht en vuil. Omdat de tassen met steekgespen en zijdelingse drukbanden kunnen worden samengeperst, schommelt de bagage niet. Ook het aanbrengen van aanvullende tassen is mogelijk.<br /><br />Overige praktische details: <br />&bull; Schuimstof achterkant verhindert schuren<br />&bull; Steeksluitingen en D-ringen<br />&bull; Handvat<br />&bull; 4 hoogwaardige reflectoren van 3M-Scotchlite materiaal<br />&bull; Bevestigingsmogelijkheid voor ORTLIEB Rack-Pack (apart bijbestellen a.u.b.)<br />&bull; Overig aanbevolen toebehoren: binnentas In-Put en buitentassen (apart bijbestellen a.u.b.)<br /><br />Belangrijke aanwijzing:<br />Uitsluitend per paar gebruiken en gelijkmatig belasten. Deken of pad tussen paard en tas leggen', '149,95', '129,95', '4013051006873', '4013051006873', NULL, 'Overige tassen');
