INSERT INTO z_export (id, rootname, naam, variant, merk, omschrijving, nprijs, prijs, jnr, jnr2, aantal, groep) VALUES (193, '1019', 'Ehbo Tas', '', 'Ortlieb', '<div class="product_tekst">Hoe belangrijk EHBO-sets zijn, merk je helaas vaak pas wanneer je ze nodig hebt. De ORTLIEB First-Aid-Kits laten geen uitvluchten meer toe. Want de compacte rode helpers overtuigen met hun lichte gewicht, hun kleine formaat, het duurzame, waterdichte materiaal en de hoge functionaliteit. Met andere woorden: hier maak je gewoon plaats voor. <p>First Aid-Kit L,<br />&bull; Conform DIN 1367 (norm voor motorrijders)<br />&bull; Rolsluiting met steekgesp en D-ringen<br />&bull; Afneembaar omhangkoord<br />&bull; Riemlussen aan de achterkant <br />&bull; Levering naar keuze met of zonder inhoud: 1 rol hechtpleister DIN13019 (5 mm x 1,25cm) - met beschermring, 1 verpakking met 8 x wondpleisters DIN 13019-E (10x6cm), 2 pakjes verband DIN 13151-M, 1 reddingsdeken goud/zilver (220 x 160 cm), 1 verbanddoek steriel DIN 13152-A (60x80cm), 1 schaar, 1 zakje met 4 x vinyl-handschoenen, 1 EHBO-brochure, 1 inhoudsopgave </p></div>', '', '39,95', '49003', '49003', 0, 'Overige tassen');
INSERT INTO z_export (id, rootname, naam, variant, merk, omschrijving, nprijs, prijs, jnr, jnr2, aantal, groep) VALUES (194, '1020', 'Hoed - Zuidwester', '', 'Ortlieb', '', '', '19,95', '49007', '49007', 1, 'Zuidwester');
INSERT INTO z_export (id, rootname, naam, variant, merk, omschrijving, nprijs, prijs, jnr, jnr2, aantal, groep) VALUES (196, '1022', 'Waterbuidel 4L', '', 'Ortlieb', '<div class="product_tekst"><p>De uitermate robuuste en toch lichte waterbuidels kunnen heel klein worden opgevouwen en vragen in lege toestand weinig opbergruimte. Dat maakt hen tot een zinvol alternatief voor de onhandig grote kunststof jerrycans en aluminium flessen. Ze hebben niet alleen hun nut voor het transporteren van water, maar ook als hoofd- en zitkussen, als flessenwarmhouder en zelfs als ballasttanks bij het deltavliegen bewezen.</p><p>Door de stevige riemgrepen zijn zij gemakkelijk te dragen, vast te maken of plaatsbesparend op te hangen, bijvoorbeeld in een tent of aan een boom. </p><p>Aanwijzing in verband met alle ORTLIEB-waterproducten: na gebruik moeten waterzak,&nbsp;waterbuidel en watergordel zonder kapje open worden neergelegd om sneller te kunnen drogen. Het is niet raadzaam om suikerhoudende of zuurhoudende dranken in deze producten te vervoeren. </p></div>', '20,95', '18,95', '46503', '46503', 2, 'Overige tassen');
