INSERT INTO z_export (id, rootname, naam, variant, merk, omschrijving, nprijs, prijs, jnr, jnr2, aantal, groep) VALUES (212, '1035', 'Packsack Met Venster M', '', 'Ortlieb', '<div class="product_tekst">De natuur laat zich graag bekijken. De bagagezak met <strong style="color: black; background-color: #ffff66">venster</strong> ook. In heavy-duty-extra-formaat verpakt hij alles, zonder het te verbergen. Zodat je altijd weet, waar je de toilettas, de zaklamp of die korte broek kunt vinden. Dat weten niet alleen ervaren avonturiers zeer te waarderen, maar ook families op vakantie. De praktische rolsluiting met verstevigde rand zorgen ervoor, dat je niet alleen snel vindt wat je zoekt, maar ook makkelijk erbij komt. <p>Overige praktische details: &bull; Steekgespen met twee D-ringen voor het aanhangen, vastsjorren of afsluiten &bull; Bodemlus voor het vastzetten of vasthouden bij het uitpakken &bull; Makkelijk van binnen en buiten te reinigen </p><p>Informatie rol-steeksluiting De makkelijk te bedienen rolsluiting bewijst zichzelf steeds weer opnieuw en is absoluut betrouwbaar. Voor het te water gaan minstens viermaal (bij compressie-bagagezakken met afdichtlippen driemaal) omrollen. Steeksluiting in elkaar steken en de complete uitrusting is hermetisch afgesloten en makkelijk hanteerbaar. </p><p>Aanwijzing: De aangegeven hoogte van de bagagezakken heeft altijd betrekking op de gesloten toestand, driemaal omgerold. Voor de hoogte in niet-gesloten toestand nog 20 cm erbij optellen</p><table border="0" cellspacing="0" cellpadding="0" width="360"><tbody><tr><td class="variaties" colspan="6"><strong>Maten (Hoogte in gesloten toestand. Voor niet gesloten hoogte 20 cm er bij tellen. ) </strong></td></tr><tr><td width="60"><div class="groep_product">Maat</div><div class="groep_maattabel">XS</div><div class="groep_maattabel">S</div><div class="groep_maattabel">M</div><div class="groep_maattabel">L</div><div class="groep_maattabel">XL</div></td><td width="60"><div class="groep_pr