INSERT INTO z_export (id, rootname, naam, variant, merk, omschrijving, nprijs, prijs, jnr, jnr2, aantal, groep) VALUES (235, '8333', 'Racing Red + Golf 100 Lenzen-Carbon Frame', 'Racing Red + Golf 100 Lenzen-Carbon Frame', 'Rudy Project', '', '', '139,90', 'SN790114G', 'SN790114G', NULL, NULL);
INSERT INTO z_export (id, rootname, naam, variant, merk, omschrijving, nprijs, prijs, jnr, jnr2, aantal, groep) VALUES (245, '8303', 'Ekynox SX', 'Impactx Photochromic Red Lenzen-Titanium Frame', 'Rudy Project', 'Op basis van het succes van de Rudy Project Ekynox is de populaire Ekynox SX ontwikkeld met mensen met een smal gezicht in het achterhoofd. Uiteraard is de bril voorzien van Rudy’s succesformule bestaande uit 360° instelbare oorrubbers, instelbare neusrubbbers, verwisselbare lenzen en de mogelijkheid voor een RX adapter (Clip-On met geslepen glazen). Maar optioneel leverbaar is een Elastic Strap om de bril stevig op de neus te houden. Concluderend een echte Rudy van slechts 31 gram.<p>Impact-X is de meest geavanceerde lens technologie die op dit moment vrijgbaar is. Sinds de introductie van de CR-39 en Policarbonaat lenzen 40 jaar geleden is er nog nooit zo een voorruitgang geboekt. Impact-X kenmerkt zich door een aantal belangrijke eigenschappen.</p>
