INSERT INTO z_export (id, rootname, naam, variant, merk, omschrijving, nprijs, prijs, jnr, jnr2, aantal, groep) VALUES (247, '793', 'Ketyum', 'Impactx Photochromic Red Lenzen-Carbon Frame', 'Rudy Project', 'Het vlaggenschip uit de collectie van Rudy Project, de Keyum, is representatief voor de passie, ervaring en technologie van Rudy Project. Jaren van onderzoek en ontwikkeling hebben geleidt tot het ontwikkelen van het revolutionaire materiaal Kynetium van magnesium, silicium en titanium dat in bril verwerkt is voor stabiliteit, duurzaamheid en een optimaal gewicht. Standaard is de Ketyum voorzien van de kenmerkende Rudy Project functionaliteiten: 360° instelbare oorrubbers, instelbare neusrubbbers, verwisselbare lenzen, mogelijkheid voor een RX adapter (Clip-On met geslepen glazen) en brilpootjes die twee (!) kanten op kunnen bewegen. <p>Impact-X is de meest geavanceerde lens technologie die op dit moment vrijgbaar is. Sinds de introductie van de CR-39 en Policarbonaat lenzen 40 jaar geleden is er nog nooit zo een voorruitgang geboekt. Impact-X kenmerkt zich door een aantal belangrijke eigenschappen.</p>
