INSERT INTO z_export (id, rootname, naam, variant, merk, omschrijving, nprijs, prijs, jnr, jnr2, aantal, groep) VALUES (646, '7435', 'Rydon + Clip-on', 'Matte Black Laser Lens', 'Rudy Project', 'De  Rydon voegt naadloos geavanceerde design technologie en materiaal wetenschap samen tot een subliem model. Voorzien van een Carbonium frame en Kynetium (Combinatie van Magnesium, Silicium en Titanium) brilpootjes maken dit model lichtgewicht (24 gram), duurzaam en flexibel. Standaard voorzien van 360° instelbare oorrubbers, instelbare neusrubbbers, verwisselbare lenzen en de mogelijkheid voor een RX adapter (Clip-On met geslepen glazen).', '', '159,90', 'sn801006', 'SN801006', NULL, 'RX-Brillen');
