INSERT INTO z_export (id, rootname, naam, variant, merk, omschrijving, nprijs, prijs, jnr, jnr2, aantal, groep) VALUES (716, '8192', 'Rydon II', 'Multilaser Orange Lenses-Graphite Frame', 'Rudy Project', 'Rudy Project heeft de Rydon opnieuw uitgevonden in de Rydon II. Met een smaller frame en kleiner glas ideaal voor mensen met een smaller gezicht. De  Rydon II voegt naadloos geavanceerde design technologie en materiaal wetenschap samen tot een subliem model. Voorzien van een Carbonium frame en Kynetium (Combinatie van Magnesium, Silicium en Titanium) brilpootjes maken dit model lichtgewicht (24 gram), duurzaam en flexibel. Standaard voorzien van 360° instelbare oorrubbers, instelbare neusrubbbers, verwisselbare lenzen en de mogelijkheid voor een RX adapter (Clip-On met geslepen glazen).', '', '134,90', 'SN944098DM', 'SN944098DM', 0, 'Sportbrillen');
