INSERT INTO z_export (id, rootname, naam, variant, merk, omschrijving, nprijs, prijs, jnr, jnr2, aantal, groep) VALUES (721, '8293', 'Rydon II ', 'Impactx Polarphoto Grey Lenzen-Carbon Frame', 'Rudy Project', 'Rudy Project heeft de Rydon opnieuw uitgevonden in de Rydon II. Met een smaller frame en kleiner glas ideaal voor mensen met een smaller gezicht. De  Rydon II voegt naadloos geavanceerde design technologie en materiaal wetenschap samen tot een subliem model. Voorzien van een Carbonium frame en Kynetium (Combinatie van Magnesium, Silicium en Titanium) brilpootjes maken dit model lichtgewicht (24 gram), duurzaam en flexibel. Standaard voorzien van 360° instelbare oorrubbers, instelbare neusrubbbers, verwisselbare lenzen en de mogelijkheid voor een RX adapter (Clip-On met geslepen glazen).<p>Impact-X is de meest geavanceerde lens technologie die op dit moment vrijgbaar is. Sinds de introductie van de CR-39 en Policarbonaat lenzen 40 jaar geleden is er nog nooit zo een voorruitgang geboekt. Impact-X kenmerkt zich door een aantal belangrijke eigenschappen.</p>
