INSERT INTO z_export (id, rootname, naam, variant, merk, omschrijving, nprijs, prijs, jnr, jnr2, aantal, groep) VALUES (729, '8328', 'Kalyos', 'Bi-Chromic Blue Lens Lenzen-Azur Frame', 'Rudy Project', 'Gebaseerd op het immense succes van het design van de Kersone en Rydon brengt Rudy Project een vergelijkbaar model voor gunstigere prijs. Voorzien van de belangrijkste Rudy kenmerken; instelbare neusrubbbers, verwisselbare lenzen en de mogelijkheid voor een RX adapter (Clip-On met geslepen glazen) maken dit model een absolute topper. Het 21 gram wegende model kan voorzien worden van een Elastic Strap om het model extra stevig op het gezicht te houden. ', '', '89,90', 'SN047081D', 'SN047081D', NULL, 'Rudy Girl');
