INSERT INTO z_export (id, rootname, naam, variant, merk, omschrijving, nprijs, prijs, jnr, jnr2, aantal, groep) VALUES (735, '8362', 'Ultimate 5 Classic', 'M  Rood', 'Ortlieb', '<div class="product_tekst">Landkaart, zonnebril, papieren of energierepen - aan het stuur heeft u alles binnen handbereik. De ULTIMATE5 modellen zijn van bijzonder duurzaam weefsel en wegen praktisch niets. Ze zijn even snel aangebracht als weer verwijderd en bewijzen hun diensten ook graag als schoudertas. Aan de fiets zijn ze betrouwbaar tegen diefstal beveiligd dankzij de afsluitbare montage aan het stuur. Een verlengadapter voor sterk gebogen sturen wordt meegeleverd (extra accessoire).<br />Altijd op koers blijven! Op de dekselsluiting van de ULTIMATE5 Plus en Classic kan een kaarttas of een GPS-hoesje worden aangebracht, beide zijn als toebehoren verkrijgbaar. De ORTLIEB stuurtassen zijn uiterst vormbestendig en duurzaam met verstevigd deksel en binnenversteviging. In maat M en L verkrijgbaar fascineren ze met hun veelzijdige functionaliteit zoals het ge&iuml;ntegreerde vakje voor waardevolle spullen. Met 3M-Scotchlite reflecterend materiaal zorgen de beide multitalenten ervoor, dat ze ook in het donker worden gezien. Ze zijn tot 3 kg belastbaar en voor sturen tot 31,8 mm diameter.<br /><br />ULTIMATE5 CLASSIC<br />&bull; Weefsel PD620/PS490<br />&bull; Uitneembare tussenschotten als toebehoren verkrijgbaar</div>', '', '74,95', '42044', '42044', 3, 'Stuurtassen');
