INSERT INTO z_export (id, rootname, naam, variant, merk, omschrijving, nprijs, prijs, jnr, jnr2, aantal, groep) VALUES (737, '47063', 'Cor13', ' Zwart/Wit', 'Ortlieb', '<p>Ortlieb heeft zowel het sportieve en dynamische element als technisch raffinement en innovatief design weten te combineren in &eacute;&eacute;n produkt: de COR13.</p><p>De nieuwe COR13 bestaat uit een minimum aan gewicht en componenten. Daarvoor in de plaats biedt het een maximum aan energie op de pedalen en vrijheid van de &ldquo;downhill-ride&rdquo;. De COR13 is gebaseerd op een concept zonder draagframe en zonder aan comfort te sparen. Met circulatiekanalen in de gewatteerde schuimstof rug wordt het lichaam goed geventileerd. De brede, comfortabele Hip-Wings, de ergonomische schouderriemen en de borstgordel zijn individueel verstelbaar, zodat de rugzak aangenaam op de rug zit en bij elke beweging gecontroleerd meebeweegt. Het 100% waterdichte nylon weefsel is uiterst slijtvast en mede ervoor verantwoordelijk dat de COR13 slechts 700 gram weegt. Aan de verstel- en afneembare helmflap aan de voorkant kan ook een andere uitrusting worden bevestigd. In het hoofdvak is een organizer ingenaaid. Een drinksysteem is probleemloos integreerbaar. </p><p>Het spreekt vanzelf, dat de COR13 ook uitermate geschikt is voor berg- en skitochten. Snowboarders kunnen hun board aan de helmflap bevestigen en zich verheugen op de betrouwbare begeleider, die zich bij de freeride zo aangenaam onopvallend gedraagt. <br /><br />Overige praktische details: <br />&bull; Waterdichte TIZIP-ritssluiting<br />&bull; Vak voor waardevolle spullen in de flap (niet waterdicht!)<br />&bull; Drinkslang-doorvoer voor drinksysteem<br />&bull; Drinkslang-clip aan de schouderriem<br />&bull; Karabijnhaak voor sleutels binnenin<br />&bull; 3M-reflecterend logo<br />&bull; Handvat</p>', '', '139,95', '47038', '47038', 0, 'Rugzakken');
