INSERT INTO z_export (id, rootname, naam, variant, merk, omschrijving, nprijs, prijs, jnr, jnr2, aantal, groep) VALUES (737, '47061', 'Cor13', ' Oranje/Zwart', 'Ortlieb', '<p>Ortlieb heeft zowel het sportieve en dynamische element als technisch raffinement en innovatief design weten te combineren in &eacute;&eacute;n produkt: de COR13.</p><p>De nieuwe COR13 bestaat uit een minimum aan gewicht en componenten. Daarvoor in de plaats biedt het een maximum aan energie op de pedalen en vrijheid van de &ldquo;downhill-ride&rdquo;. De COR13 is gebaseerd op een concept zonder draagframe en zonder aan comfort te sparen. Met circulatiekanalen in de gewatteerde schuimstof rug wordt het lichaam goed geventileerd. De brede, comfortabele Hip-Wings, de ergonomische schouderriemen en de borstgordel zijn individueel verstelbaar, zodat de rugzak aangenaam op de rug zit en bij elke beweging gecontroleerd meebeweegt. Het 100% waterdichte nylon weefsel is uiterst slijtvast en mede ervoor verantwoordelijk dat de COR13 slechts 700 gram weegt. Aan de verstel- en afneembare helmflap aan de voorkant kan ook een andere uitrusting worden bevestigd. In het hoofdvak is een organizer ingenaaid. Een drinksysteem is probleemloos integreerbaar. </p><p>Het spreekt vanzelf, dat de COR13 ook uitermate geschikt is voor berg- en skitochten. Snowboarders kunnen hun board aan de helmflap bevestigen en zich verheugen op de betrouwbare begeleider, die zich bij de freeride zo aangenaam onopvallend gedraagt. <br /><br />Overige praktische details: <br />&bull; Waterdichte TIZIP-ritssluiting<br />&bull; Vak voor waardevolle spullen in de flap (niet waterdicht!)<br />&bull; Drinkslang-doorvoer voor drinksysteem<br />&bull; Drinkslang-clip aan de schouderriem<br />&bull; Karabijnhaak voor sleutels binnenin<br />&bull; 3M-reflecterend logo<br />&bull; Handvat</p>', '', '139,95', '47041', '47041', 0, 'Rugzakken');
INSERT INTO z_export (id, rootname, naam, variant, merk, omschrijving, nprijs, prijs, jnr, jnr2, aantal, groep) VALUES (738, '47064', 'Flight 22L', ' Zwart', 'Ortlieb', '<div class="product_tekst">Wie bij het &quot;biken&quot; en &quot;hiken&quot; van optimale bewegingsvrijheid wil genieten en op dagtochten de belangrijkste benodigdheden het liefst comfortabel en dicht bij zich draagt, waant zich met de lichte, compacte Flight in hogere sferen! Proviand, papieren, kaarten, regen- en reservekleding, reserveband - de Flight heeft voor alles een plaatsje, en volkomen waterdicht. </div><div class="product_tekst">Ook bij enorme lichamelijke inspanning voelt het aangenaam op de rug en dankzij het ademende draagsysteem met mesh-rugpand wordt het lichaam goed geventileerd. Met de brede heupgordel en de elastische borstgordel wordt de Flight&nbsp;individueel aan de vorm van het lichaam aangepast. Hoofdvak en voorvak zijn waterdicht en voorzien van TIZIP-ritssluitingen. Aan beide zijden bevindt zich elk een neopreen zijvak met afvoeropening. Zo heeft u de drinkfles of uw regenkleding altijd binnen handbereik. Bij extra behoefte aan vochtinname kan een eigen drinksysteem worden ge&iuml;ntegreerd. De drinkslang-doorvoer wordt van binnen naar buiten hermetisch afgedicht(bij gangbare drinkslangen tot 10,5 cm diameter) en kan van binnen geheel worden gesloten. De helm wordt met een paar handgrepen aan de helmflap van netstof bevestigd, die onopvallend in een ritsvakje aan de onderkant is aangebracht. Daarnaast bevindt zich een houder voor het knipperlicht. De Flight is verkrijgbaar in twee formaten. </div><p class="product_tekst">Overige praktische details: <br />&bull; Organizer in A4-formaat<br />&bull; Vak voor waardevolle spullen<br />&bull; Handvat<br />&bull; Reflectoren op de schouderriemen en voorkant <br />&bull; Hoofdvak met mogelijkheid voor hangslot</p>', '', '169,95', '47037', '47037', 0, 'Rugzakken');
