INSERT INTO z_export (id, rootname, naam, variant, merk, omschrijving, nprijs, prijs, jnr, jnr2, aantal, groep) VALUES (747, '47276', 'Ekynox Sx Girl Pink', 'Rydon II Pink', 'Rudy Project', 'Op basis van het succes van de Rudy Project Ekynox is de populaire Ekynox SX ontwikkeld met mensen met een smal gezicht in het achterhoofd. Uiteraard is de bril voorzien van Rudy’s succesformule bestaande uit 360° instelbare oorrubbers, instelbare neusrubbbers, verwisselbare lenzen en de mogelijkheid voor een RX adapter (Clip-On met geslepen glazen). Maar optioneel leverbaar is een Elastic Strap om de bril stevig op de neus te houden. Concluderend een echte Rudy van slechts 31 gram.', '', '44,90', 'LE9471D', 'LE9471D', NULL, NULL);
