INSERT INTO z_export (id, rootname, naam, variant, merk, omschrijving, nprijs, prijs, jnr, jnr2, aantal, groep) VALUES (748, '47191', 'Rydon', 'Ekynox Sx', 'Rudy Project', 'De  Rydon voegt naadloos geavanceerde design technologie en materiaal wetenschap samen tot een subliem model. Voorzien van een Carbonium frame en Kynetium (Combinatie van Magnesium, Silicium en Titanium) brilpootjes maken dit model lichtgewicht (24 gram), duurzaam en flexibel. Standaard voorzien van 360° instelbare oorrubbers, instelbare neusrubbbers, verwisselbare lenzen en de mogelijkheid voor een RX adapter (Clip-On met geslepen glazen).', '', '33,90', 'LE7608', 'LE7608', NULL, NULL);
