INSERT INTO z_export (id, rootname, naam, variant, merk, omschrijving, nprijs, prijs, jnr, jnr2, aantal, groep) VALUES (754, '47354', 'Exception EVO STD', 'Smoke Black Lenzen-Titanium Frame', 'Rudy Project', '<p>Veelzijdig, comfortabel, slank en voorzien van RX mogelijkheden. Een echte baanbrekende visie van Rudy Procject.</p><p> De Exception brengt een veelzijdig aanbod aan mogelijkheden samen in een technologisch design. Gebaseerd op het succes van de designs van Rudy (Ketyum, Rydon (II)) en de revolutionaire Flip-Up technologie (RB3, Perception en Kabrio) maken de Exception een designers meesterwerk dat alle grootte technologieën van Rudy Project combineert in één superieur model.</p><p> De Rudy Project lenzen kunnen direct in het frame worden geplaatst of in combinatie met de meegeleverde RX Clip-On in de handige meegeleverde Flip-up die aan het frame kan worden bevestigd. Hierdoor biedt de Exception veel mogelijkheden voor elke gebruiker in elke situatie. Daarnaast is de Exception uiteraard voorzien van 360° instelbare oorrubbers, instelbare neusrubbbers en verwisselbare lenzen. </p><p>
