INSERT INTO z_export (id, rootname, naam, variant, merk, omschrijving, nprijs, prijs, jnr, jnr2, aantal, groep) VALUES (756, '47378', 'Koerierstas Pro', '', 'Ortlieb', '<div class="product_tekst">De&nbsp;slime koerier verspreidt zijn boodschap niet alleen gestouwd in zijn tas, maar ook naar buiten toe, voor iedereen zichtbaar. De Messenger Bag Pro biedt de professionele mogelijkheid voor extra reclame-inkomsten resp. eigenreclame. In het transparante, waterdichte insteekvak op de rug past een A3-affiche. Ook het interieur van de tas heeft ORTLIEB met insider-knowhow ontworpen: de losknoopbare binnentas met ritssluiting voor vrachtbonnen, plattegronden, pennen enz. is tevens als gordeltas draagbaar. Het organizervak voor belangrijke papieren houdt dankzij de praktische onderverdeling orde op zaken. De rolsluiting met extra lang klittenband maakt de tas makkelijk en snel toegankelijk en heeft geen moeite met zendingen van buitengewoon formaat. Wie de hele dag op de weg zit, kent het belang van veiligheidsvoorzieningen: de Messenger Bag Pro&nbsp;heeft grote reflectoren aan alle kanten.<br /><br />Als toebehoren voor de koeriertas en de Messenger Pro&nbsp;verkrijgbaar: <br />&bull; GSM-houder<br />&bull; Radiohouder<br />&bull; Beugelslothouder<br /><br /><table border="0" cellspacing="0" cellpadding="0"><tbody><tr><td class="variaties" colspan="5"><strong>Maten</strong></td></tr><tr><td width="60"><div class="groep_product">Hoogte </div><div class="groep_maattabel">50&nbsp;cm </div></td><td width="60"><div class="groep_product">Breedte</div><div class="groep_maattabel">39&nbsp;cm </div></td><td width="60"><div class="groep_product">Diepte</div><div class="groep_maattabel">15,5 cm </div></td><td width="60"><div class="groep_product">Gewicht</div><div class="groep_maattabel">1880&nbsp;g</div></td><td width="60"><div class="groep_product">Inhoud</div><div class="groep_maattabel">30&nbsp;L </div></td></tr></tbody></table></div>', '', '149,95', '48511', '48511', NULL, 'Rugzakken');
