INSERT INTO z_export (id, rootname, naam, variant, merk, omschrijving, nprijs, prijs, jnr, jnr2, aantal, groep) VALUES (833, '47970', 'Organiser voor koerierstas', 'Voor Koerierstas', 'Ortlieb', 'Bewaart de transportdocumenten kreukvrij en overzichtelijk in de koeriertas. Een A4-vak, 2 kleine insteekvakken en twee pennenvakjes maken van het orde houden een kinderspel. De Organizer wordt met een drukknoop in de tas bevestigd en kan tevens met de gordeltas worden gecombineerd. ', '', '16,95', '48521', '48521', 2, 'Accessoires');
INSERT INTO z_export (id, rootname, naam, variant, merk, omschrijving, nprijs, prijs, jnr, jnr2, aantal, groep) VALUES (834, '47973', 'Packsack PD350 Zwart L', '', 'Ortlieb', '<div class="product_tekst">Pack &amp; go! Naar dit principe kunnen zaken snel worden ingepakt en sluit ze hermetisch af en hermetisch worden afgesloten. De voordelige, duurzame bagagezak is daarom tevens onze geheime tip voor rugzakken die niet waterdicht zijn. In de PD 350 met zijn betrouwbare rolsluiting en verstevigde rand blijven slaapzakken droog, is proviand en bekleding goed verpakt en door het samendrukken overal te verstouwen. <p>Overige praktische details: <br />&bull; Steekgespen met twee D-ringen voor het vastsjorren of afsluiten <br />&bull; Bodemlus voor het vastzetten of vasthouden bij het uitpakken <br />&bull; Verstevigde bodem van PD 620 voor een stabiele stand <br />&bull; Makkelijk van binnen te reinigen </p><p>Informatie rol-steeksluiting De makkelijk te bedienen rolsluiting bewijst zichzelf steeds weer opnieuw en is absoluut betrouwbaar. Voor het te water gaan minstens viermaal (bij compressie-bagagezakken met afdichtlippen driemaal) omrollen. Steeksluiting in elkaar steken en de complete uitrusting is hermetisch afgesloten en makkelijk hanteerbaar. </p><p>Aanwijzing: De aangegeven hoogte van de bagagezakken heeft altijd betrekking op de gesloten toestand, driemaal omgerold. Voor de hoogte in niet-gesloten toestand nog 20 cm erbij optellen. </p><table border="0" cellspacing="0" cellpadding="0" width="360"><tbody><tr><td class="variaties" colspan="6"><strong>Maten (Hoogte in gesloten toestand. Voor niet gesloten hoogte 20 cm er bij tellen. ) </strong></td></tr><tr><td width="60"><div class="groep_product">Maat</div><div class="groep_maattabel">XS</div><div class="groep_maattabel">S</div><div class="groep_maattabel">M</div><div class="groep_maattabel">L</div><div class="groep_maattabel">XL</div></td><td width="60"><div class="groep_product">Hoogte </div><div class="groep_maattabel">42 cm </div><div class="groep_maattabel">52 cm </div><div class="groep_maattabel">60 cm </div><div class="groep_maattabel">70 cm </div><div class="groep_maattabel">80 cm </div></td><td width="60"><div class="groep_product">Omvang </div><div class="groep_maattabel">60 cm </div><div class="groep_maattabel">70 cm </div><div class="groep_maattabel">83 cm </div><div class="groep_maattabel">96 cm </div><div class="groep_maattabel">122 cm </div></td><td width="60"><div class="groep_product">Diameter </div><div class="groep_maattabel">19 cm </div><div class="groep_maattabel">22 cm </div><div class="groep_maattabel">26 cm </div><div class="groep_maattabel">31 cm </div><div class="groep_maattabel">39 cm </div></td><td width="60"><div class="groep_product">Gewicht</div><div class="groep_maattabel">220 g</div><div class="groep_maattabel">280 g </div><div class="groep_maattabel">370 g</div><div class="groep_maattabel">460 g</div><div class="groep_maattabel">670 g</div></td><td width="60"><div class="groep_product">Inhoud</div><div class="groep_maattabel">13 L </div><div class="groep_maattabel">22 L </div><div class="groep_maattabel">35 L </div><div class="groep_maattabel">59 L </div><div class="groep_maattabel">109 L </div></td></tr></tbody></table></div>', '', '23,95', '45514', '45514', 1, 'Bagage zakken');
INSERT INTO z_export (id, rootname, naam, variant, merk, omschrijving, nprijs, prijs, jnr, jnr2, aantal, groep) VALUES (835, '47972', 'Packsack PD350 Rood L', '', 'Ortlieb', '<div class="product_tekst">Pack &amp; go! Naar dit principe kunnen zaken snel worden ingepakt en sluit ze hermetisch af en hermetisch worden afgesloten. De voordelige, duurzame bagagezak is daarom tevens onze geheime tip voor rugzakken die niet waterdicht zijn. In de PD 350 met zijn betrouwbare rolsluiting en verstevigde rand blijven slaapzakken droog, is proviand en bekleding goed verpakt en door het samendrukken overal te verstouwen. <p>Overige praktische details: <br />&bull; Steekgespen met twee D-ringen voor het vastsjorren of afsluiten <br />&bull; Bodemlus voor het vastzetten of vasthouden bij het uitpakken <br />&bull; Verstevigde bodem van PD 620 voor een stabiele stand <br />&bull; Makkelijk van binnen te reinigen </p><p>Informatie rol-steeksluiting De makkelijk te bedienen rolsluiting bewijst zichzelf steeds weer opnieuw en is absoluut betrouwbaar. Voor het te water gaan minstens viermaal (bij compressie-bagagezakken met afdichtlippen driemaal) omrollen. Steeksluiting in elkaar steken en de complete uitrusting is hermetisch afgesloten en makkelijk hanteerbaar. </p><p>Aanwijzing: De aangegeven hoogte van de bagagezakken heeft altijd betrekking op de gesloten toestand, driemaal omgerold. Voor de hoogte in niet-gesloten toestand nog 20 cm erbij optellen. </p><table border="0" cellspacing="0" cellpadding="0" width="360"><tbody><tr><td class="variaties" colspan="6"><strong>Maten (Hoogte in gesloten toestand. Voor niet gesloten hoogte 20 cm er bij tellen. ) </strong></td></tr><tr><td width="60"><div class="groep_product">Maat</div><div class="groep_maattabel">XS</div><div class="groep_maattabel">S</div><div class="groep_maattabel">M</div><div class="groep_maattabel">L</div><div class="groep_maattabel">XL</div></td><td width="60"><div class="groep_product">Hoogte </div><div class="groep_maattabel">42 cm </div><div class="groep_maattabel">52 cm </div><div class="groep_maattabel">60 cm </div><div class="groep_maattabel">70 cm </div><div class="groep_maattabel">80 cm </div></td><td width="60"><div class="groep_product">Omvang </div><div class="groep_maattabel">60 cm </div><div class="groep_maattabel">70 cm </div><div class="groep_maattabel">83 cm </div><div class="groep_maattabel">96 cm </div><div class="groep_maattabel">122 cm </div></td><td width="60"><div class="groep_product">Diameter </div><div class="groep_maattabel">19 cm </div><div class="groep_maattabel">22 cm </div><div class="groep_maattabel">26 cm </div><div class="groep_maattabel">31 cm </div><div class="groep_maattabel">39 cm </div></td><td width="60"><div class="groep_product">Gewicht</div><div class="groep_maattabel">220 g</div><div class="groep_maattabel">280 g </div><div class="groep_maattabel">370 g</div><div class="groep_maattabel">460 g</div><div class="groep_maattabel">670 g</div></td><td width="60"><div class="groep_product">Inhoud</div><div class="groep_maattabel">13 L </div><div class="groep_maattabel">22 L </div><div class="groep_maattabel">35 L </div><div class="groep_maattabel">59 L </div><div class="groep_maattabel">109 L </div></td></tr></tbody></table></div>', '', '23,95', '45509', '45509', 0, 'Bagage zakken');
