INSERT INTO z_export (id, rootname, naam, variant, merk, omschrijving, nprijs, prijs, jnr, jnr2, aantal, groep) VALUES (937, '48133', 'Office Bag2', 'Zilver Antraciet', 'Ortlieb', '<div class="product_tekst">De uiterst professionele koffer, Office Bag2,&nbsp;voor iedereen die op zoek naar nieuwe levenskwaliteit, de stressfactor van het spitsuur met het rustgevende fietsen en frisse lucht wil vervangen. De Office-Bag2 maakt zelfs van de weg naar kantoor een aangenaam genoegen. De stijlgetrouwe attach&eacute;koffer wordt in een handomdraai op de bagagedrageradapter vastgeklikt en blijft gegarandeerd op zijn plaats. Werkdocumenten, pennen, sleutels, gsm en persoonlijke bezittingen komen veilig, droog en onbeschadigd op hun plaats van bestemming aan. Uw laptop past comfortabel in de uitneembare notebook-inzet. Vanzelfsprekend biedt de onbreekbare hardshell koffer ook voldoende opbergruimte voor extra kleding. Wie na het werk nog boodschappen moet doen of meer mee te nemen heeft, kan aan de zijkanten nog extra fietstassen hangen. <p>Overige praktische details:<br />&bull; Waterdichte, afsluitbare 2-richtingen-TIZIP-ritssluiting<br />&bull; Handvat met cijferslot<br />&bull; Inclusief bagage-adapter en frame voor het aanhangen van fietstassen<br />De schouderriem is als accessoire verkrijgbaar</p><p>INFO:<br />Alle koffers zijn gemaakt van onbreekbaar polycarbonaat. Dit materiaal is stootvast, extreem belastbaar en beschermt tegen vocht en vuil. Bovendien zijn de Tour-Box, Office-Bag2 en Shuttle Bike voorzien van de waterdichte, afsluitbare TIZIP-ritssluiting</p></div>', '', '169,95', '44032', '44032', 0, '(Fiets) Achtertassen');
INSERT INTO z_export (id, rootname, naam, variant, merk, omschrijving, nprijs, prijs, jnr, jnr2, aantal, groep) VALUES (937, '48132', 'Office Bag2', 'Zwart', 'Ortlieb', '<div class="product_tekst">De uiterst professionele koffer, Office Bag2,&nbsp;voor iedereen die op zoek naar nieuwe levenskwaliteit, de stressfactor van het spitsuur met het rustgevende fietsen en frisse lucht wil vervangen. De Office-Bag2 maakt zelfs van de weg naar kantoor een aangenaam genoegen. De stijlgetrouwe attach&eacute;koffer wordt in een handomdraai op de bagagedrageradapter vastgeklikt en blijft gegarandeerd op zijn plaats. Werkdocumenten, pennen, sleutels, gsm en persoonlijke bezittingen komen veilig, droog en onbeschadigd op hun plaats van bestemming aan. Uw laptop past comfortabel in de uitneembare notebook-inzet. Vanzelfsprekend biedt de onbreekbare hardshell koffer ook voldoende opbergruimte voor extra kleding. Wie na het werk nog boodschappen moet doen of meer mee te nemen heeft, kan aan de zijkanten nog extra fietstassen hangen. <p>Overige praktische details:<br />&bull; Waterdichte, afsluitbare 2-richtingen-TIZIP-ritssluiting<br />&bull; Handvat met cijferslot<br />&bull; Inclusief bagage-adapter en frame voor het aanhangen van fietstassen<br />De schouderriem is als accessoire verkrijgbaar</p><p>INFO:<br />Alle koffers zijn gemaakt van onbreekbaar polycarbonaat. Dit materiaal is stootvast, extreem belastbaar en beschermt tegen vocht en vuil. Bovendien zijn de Tour-Box, Office-Bag2 en Shuttle Bike voorzien van de waterdichte, afsluitbare TIZIP-ritssluiting</p></div>', '', '169,95', '44042', '44042', 2, '(Fiets) Achtertassen');
