INSERT INTO z_export (id, rootname, naam, variant, merk, omschrijving, nprijs, prijs, jnr, jnr2, aantal, groep) VALUES (1327, '49254', 'Travel Biker Set', '', 'Ortlieb', 'Globetrotter, wat wil je nog meer? Of het nu het grote avontuur, een georganiseerde fietstocht of erop uit met het hele gezin is: de waterdichte set van Cordura is de oplossing voor het transporteren van uitrusting en bagage. Kleding, die niet mag kreuken krijgt een plaatsje in de grote koffer, toilettas, schoenen en alle andere belangrijke dingen worden ondergebracht in de fietstassen aan de achterdrager en gereedschap met toebehoren blijft in de aan de fietstassen bevestigde buitentassen binnen handbereik. Kaarten, waardevolle bezittingen en geld bergt u liever op in de stuurtas. Dankzij de meegeleverde diefstalbeveiliging kunnen de fietstassen ook aan de fiets blijven, voor vreemden ontoegankelijk. <br /><br />In de levering inbegrepen:<br />&bull; Fietskoffer Travel-Biker inclusief kofferadapter<br />&bull; Twee achterfietstassen Bike-Tourer <br />&bull; Buitentas, maat S en diefstalbeveiliging <br />&bull; Stuurtas Ultimate5 M PLUS ', '', '435,00', '44026', '44026', NULL, 'Tassen sets');
INSERT INTO z_export (id, rootname, naam, variant, merk, omschrijving, nprijs, prijs, jnr, jnr2, aantal, groep) VALUES (1330, '49258', 'Stuurhouder CS-Serie', '', 'Polar', '', '', '7,95', '91028692', '91028692', 3, 'Polar Accessoires');
INSERT INTO z_export (id, rootname, naam, variant, merk, omschrijving, nprijs, prijs, jnr, jnr2, aantal, groep) VALUES (1331, '49261', 'Rododendro', 'Polar Compatibel MT-M', 'Nalini', '<p>Met de introductie van de nieuwe Nalini koersbroek, model Rododendro, is bij het gebruik van een Polar hartslagmeter de borstband niet langer nodig. Het gedeelte van de borstband dat de hartslag opvangt is ge&iuml;ntegreerd in het mesh bovenstuk van deze high-end koersbroek. </p><p>De zender van de traditionele (WearLink) borstband wordt middels drukkers op de buitenzijde bevestigd. Deze innovatieve vondst is uitvoerig getest door de verschillende profploegen in de Tour de France en werkt in combinatie met alle type Polar hartslagmeters en merken die functioneren met een Polar zender en borstband. De Rododendro is een high-end koersbroek in &lsquo;New Port''. Dit is een zogenaamd &lsquo;Power Lycra'', dat voor een extreem goede spierondersteuning zorgt. </p><p>De broeken zijn uitgevoerd met luxe details als platte naden in contrastkleur, mesh bovenstuk, siliconen gripper en de nieuwe Nalini UCN top zeem. </p>', '', '139,95', '1730304', '1730304', 1, 'Heren Fietsbroek');
