INSERT INTO z_export (id, rootname, naam, variant, merk, omschrijving, nprijs, prijs, jnr, jnr2, aantal, groep) VALUES (1461, '49845', 'Corsaire XL', '', 'Chariot', '<div class="product_tekst"><p>In het touringmodel&nbsp;Corsaire CTS steekt de kennis en ervaring van meer dan 10 jaar productie, het is de betrouwbare klassieker uit de Chariot-familie Dikke elastomeer veren vangen de schokken tijdens het rijden op, en op de doekzitting zitten uw kinderen veilig en comfortabel, en uw bagage past in de kofferruimte achter de zitting. De Corsaire CTS weegt slechts 10,7 kilo en is opgevouwen bijzonder klein, wat hem bijzonder geschikt maakt voor op reis. Uitgeklapt is hij zo ruim dat uw kind zich ook op langere reizen op zijn of haar gemak voelt.&nbsp;</p><p><u>Corsaire&nbsp;XL - luxe uitrusting:<br /></u></p><ul><li>Tweezitter </li><li>Geadoniseerd aluminium frame </li><li>Extra grote binnenruimte </li><li>Parkeerrem </li><li>Zeer veilig 5-punts gordelsysteem </li><li>Goed geventileerde hoofdruimte </li><li>IJzersterke zitplaatsbevestiging </li><li>Gecombineerde insecten- en regendek </li><li>Stuurbeugel verstelbaar in 2 posities </li><li>Grote bagageruimte </li><li>20 inch spaakwielen </li><li>3M-Scotchlite reflectiebanden </li><li>Sleuven voor bevestigen Weber babyschaal </li><li>Gestoffeerde borst- en schoudergordels met steekgespen </li><li>Gestoffeerde zitting </li><li>7,5 cm extra breedte en hoogte </li><li>Zijdelingse ventilatiegaten </li><li>Extra opbergvak in bagageruimte </li><li>Individueel instelbare bladvering </li></ul><p>Om de kar te gebruiken i.c.m. bijvoorbeeld de fiets of als wandelwagen dient u de daarvoor benodigde accessoires te bestellen. Zie daarvoor de accessoires rechts bovenaan.</p><p><table border="0" cellspacing="0" cellpadding="0"><tbody><tr><td class="variaties" colspan="6"><strong>Technische gegevens </strong></td></tr><tr><td width="150"><div class="groep_product">Corsaire&nbsp;XL</div><div class="groep_maattabel">Afmetingen L x B x H</div><div class="groep_maattabel">Zitbreedte</div><div class="groep_maattabel">Voetruimte</div><div class="groep_maattabel">Hoofdhoogte</div><div class="groep_maattabel">Gewicht</div><div class="groep_maattabel">Belasting</div><div class="groep_maattabel">Duwstang hoogte</div><div class="groep_maattabel">Zitplaatsen</div></td><td width="155"><div class="groep_product">Uitgevouwen </div><div class="groep_maattabel">99&nbsp;cm x 82 cm x&nbsp;95 cm&nbsp;</div><div class="groep_maattabel">59&nbsp;cm</div><div class="groep_maattabel">53 cm </div><div class="groep_maattabel">67,5 cm </div><div class="groep_maattabel">10,7 kg </div><div class="groep_maattabel">45 kg </div><div class="groep_maattabel">100&nbsp;cm / 112 cm</div><div class="groep_maattabel">2 </div></td><td width="155"><div class="groep_product">Opgevouwen </div><div class="groep_maattabel">98&nbsp;cm x&nbsp;79 cm x&nbsp;28 cm </div><div class="groep_maattabel">n.v.t. </div><div class="groep_maattabel">n.v.t. </div><div class="groep_maattabel">n.v.t. </div><div class="groep_maattabel">10,7 kg </div><div class="groep_maattabel">n.v.t. </div><div class="groep_maattabel">n.v.t.</div><div class="groep_maattabel">n.v.t. </div></td></tr></tbody></table></p></div>', '', '599,00', 'AHWC42-', 'AHWC42', 1, 'Kinderkarren');
INSERT INTO z_export (id, rootname, naam, variant, merk, omschrijving, nprijs, prijs, jnr, jnr2, aantal, groep) VALUES (1462, '49844', 'Captain XL', '', 'Chariot', '<div class="product_tekst"><p>Het tweepersoons citymodel Captain&nbsp;CTS heeft &eacute;&eacute;n groot voordeel: veel plaats voor kinderen en bagage! Dat is vooral te danken aan de stevige bodem, die over de beide wielen heen loopt, en daarachter nog breder wordt, waardoor u over een extra grote kofferruimte beschikt. De wand, die gemaakt is van stevig, niet te scheuren polyetheen, zorgt voor extra stabiliteit en bescherming. Het is de ideale shopping-begleider.<br /><u><br />Captain XL luxe-uitrusting:</u></p><ul><li>Tweezitter </li><li>7,5 cm meer hoogte dan andere Chariot modellen </li><li>Extra breed door bodemkuip </li><li>Vernieuwde stuurbeugel </li><li>Gestoffeerde zitting </li><li>Sleuven voor bevestigen Weber babyschaal </li><li>Grote bagageruimte </li><li>2-in-1 regendek </li><li>Stuur verstelbaar in 2 posities </li><li>Veilig 5-punts gordelsysteem met steekgespen </li><li>Parkeerrem </li><li>Geanodiseerd aluminium frame </li><li>20 inch spaakwielen </li><li>Sterke zitplaatsbevestiging </li><li>Veilig 5-punts gordelsysteem </li><li>3M-Scotchlite reflectiebanden </li><li>Gestoffeerde borst- en schoudergordels </li><li>Zijdelingse ventilatiegaten </li><li>Extra opbergvak in bagageruimte </li><li>Veel ombouwmogelijkheden met de CTS-sets </li></ul><p>De bodem kuip van de Captain Xl is gemaakt van UV-bestendig polyethyl en is tevens het spatbord. De kuip vergoot de binnenruimte en is ge&iuml;ntegreerdn met het frame. De bladvering zorgt voor een comfortabele rit, en is individueel instelbaar. De soepele vering is onderhousvrij en eenvoudig in gebruik.</p><p>Om de kar te gebruiken i.c.m. bijvoorbeeld de fiets of als wandelwagen dient u de daarvoor benodigde accessoires te bestellen. Zie daarvoor de accessoires rechts bovenaan.</p><table border="0" cellspacing="0" cellpadding="0"><tbody><tr><td class="variaties" colspan="6"><strong>Technische gegevens </strong></td></tr><tr><td width="150"><div class="groep_product">Captain&nbsp;XL</div><div class="groep_maattabel">Afmetingen L x B x H</div><div class="groep_maattabel">Zitbreedte</div><div class="groep_maattabel">Voetruimte</div><div class="groep_maattabel">Hoofdhoogte</div><div class="groep_maattabel">Gewicht</div><div class="groep_maattabel">Belasting</div><div class="groep_maattabel">Duwstang hoogte</div><div class="groep_maattabel">Zitplaatsen</div></td><td width="155"><div class="groep_product">Uitgevouwen </div><div class="groep_maattabel">102 cm x 84 cm x 36 cm&nbsp;</div><div class="groep_maattabel">64 cm</div><div class="groep_maattabel">50 cm </div><div class="groep_maattabel">67,5 cm </div><div class="groep_maattabel">14 kg </div><div class="groep_maattabel">45 kg </div><div class="groep_maattabel">97 cm / 109 cm</div><div class="groep_maattabel">2 </div></td><td width="155"><div class="groep_product">Opgevouwen </div><div class="groep_maattabel">102 cm x 82 cm x 36 cm </div><div class="groep_maattabel">n.v.t. </div><div class="groep_maattabel">n.v.t. </div><div class="groep_maattabel">n.v.t. </div><div class="groep_maattabel">14 kg </div><div class="groep_maattabel">n.v.t. </div><div class="groep_maattabel">n.v.t.</div><div class="groep_maattabel">n.v.t. </div></td></tr></tbody></table></div>', '', '699,00', 'AHWC32-', 'AHWC32', 1, 'Kinderkarren');
INSERT INTO z_export (id, rootname, naam, variant, merk, omschrijving, nprijs, prijs, jnr, jnr2, aantal, groep) VALUES (1463, '49810', 'Cabriolet', '', 'Chariot', '<div class="product_tekst"><p>In het touringmodel Cabriolet CTS is de ervaring van meer dan 10 jaar productiekennis gestoken, het is de betrouwbare klassieker uit de Chariot-familie. Uw kinderen zitten veilig in de doekzitting, en uw bagage past in de kofferruimte daarachter. De Cabriolet CTS weegt slechts 10,5 kilo is opgevouwen bijzonder klein, wat hem uitermate geschikt maakt voor het reizen. Uitgeklapt is hij zo ruim, dat uw kind zich ook tijdens lange ritten altijd goed op zijn of haar gemak voelt.</p><p><u>Cabriolet - basisuitrusting</u></p><ul><li>Tweezitter </li><li>Geadoniseerd aluminium frame </li><li>Extra grote binnenruimte </li><li>Parkeerrem </li><li>Zeer veilig 5-punts luxe gordelsysteem met steekgespen </li><li>Goed geventileerde hoofdruimte </li><li>IJzersterke zitplaatsbevestiging </li><li>Gecombineerde insecten- en regendek </li><li>Stuurbeugel verstelbaar in 2 posities </li><li>Grote bagageruimte </li><li>Extra opbergvak in bagageruimte </li><li>20 inch spaakwielen </li><li>3M-Scotchlite reflectiebanden </li><li>Sleuven voor bevestigen Weber babyschaal </li><li>Veel ombouwmogelijkheden met de CTS-sets </li></ul><p><table border="0" cellspacing="0" cellpadding="0"><tbody><tr><td class="variaties" colspan="6"><strong>Technische gegevens </strong></td></tr><tr><td width="150"><div class="groep_product">Cabriolet</div><div class="groep_maattabel">Afmetingen L x B x H</div><div class="groep_maattabel">Zitbreedte</div><div class="groep_maattabel">Voetruimte</div><div class="groep_maattabel">Hoofdhoogte</div><div class="groep_maattabel">Gewicht</div><div class="groep_maattabel">Belasting</div><div class="groep_maattabel">Duwstang hoogte</div><div class="groep_maattabel">Zitplaatsen</div></td><td width="155"><div class="groep_product">Uitgevouwen </div><div class="groep_maattabel">99&nbsp;cm x 82 cm x&nbsp;92cm&nbsp;</div><div class="groep_maattabel">57 cm</div><div class="groep_maattabel">53 cm </div><div class="groep_maattabel">60 cm </div><div class="groep_maattabel">10,5kg </div><div class="groep_maattabel">45 kg </div><div class="groep_maattabel">97 cm / 109 cm</div><div class="groep_maattabel">2 </div></td><td width="155"><div class="groep_product">Opgevouwen </div><div class="groep_maattabel">98&nbsp;cm x&nbsp;79 cm x&nbsp;28 cm </div><div class="groep_maattabel">n.v.t. </div><div class="groep_maattabel">n.v.t. </div><div class="groep_maattabel">n.v.t. </div><div class="groep_maattabel">10,5 kg</div><div class="groep_maattabel">n.v.t. </div><div class="groep_maattabel">n.v.t.</div><div class="groep_maattabel">n.v.t. </div></td></tr></tbody></table></p></div>', '', '469,00', 'AHWC52-', 'AHWC52', 1, 'Kinderkarren');
INSERT INTO z_export (id, rootname, naam, variant, merk, omschrijving, nprijs, prijs, jnr, jnr2, aantal, groep) VALUES (1464, '49842', 'Cougar 1', '', 'Chariot', '<div class="product_tekst">Een laag gelegen zwaartepunt verbetert de wegligging. Dit constructieprincipe is bepalend voor de sportmodellen. Het chassis eindigt direct achter de zitting, het zwaartepunt ligt onder de as. Deze constructie is niet alleen functioneel, het zorgt ook voor een zeer aerodynamisch design. Met de Cougar&nbsp;CTS heeft u overal een sportieve uitusting, in het park, het bos, op het platteland of het strand.<br /><br /><u>Cougar 1 luxe uitrusting:</u><br /><ul><li>1-zitter </li><li>2-in-1 regendek met ristsluiting </li><li>Individueel instelbare bladvering </li><li>Spaakwielen van licht aluminium </li><li>Gestoffeerde veiligheidsgordel </li><li>Met de hand uitwasbare gestoffeerde zitting </li><li>Gestoffeerde rugleuning </li><li>Zijdelingse ventilatiegaten </li><li>Extra beenruimte </li><li>Groot bagagevak </li><li>3M-Scotchlite reflectiebanden </li></ul><p>De bladvering zorgt voor een comfortabele rit, en is individueel instelbaar. De soepele vering is onderhousvrij en eenvoudig in gebruik.</p><p>Om de kar te gebruiken i.c.m. bijvoorbeeld de fiets of als wandelwagen dient u de daarvoor benodigde accessoires te bestellen. Zie daarvoor de accessoires rechts bovenaan.</p><p><table border="0" cellspacing="0" cellpadding="0"><tbody><tr><td class="variaties" colspan="6"><strong>Technische gegevens </strong></td></tr><tr><td width="150"><div class="groep_product">Cougar 1</div><div class="groep_maattabel">Afmetingen L x B x H</div><div class="groep_maattabel">Zitbreedte</div><div class="groep_maattabel">Voetruimte</div><div class="groep_maattabel">Hoofdhoogte</div><div class="groep_maattabel">Gewicht</div><div class="groep_maattabel">Belasting</div><div class="groep_maattabel">Duwstang hoogte</div><div class="groep_maattabel">Zitplaatsen</div></td><td width="155"><div class="groep_product">U