INSERT INTO z_export (id, rootname, naam, variant, merk, omschrijving, nprijs, prijs, jnr, jnr2, aantal, groep) VALUES (1489, '49852', 'CX1', '', 'Chariot', '<div class="product_tekst"><p>De nieuwe&nbsp;CX1 en CX 2 zetten een nieuwe standaard. We hebben alleen de beste onderdelen gebruikt.<br />Vooral de vering, de verstelbare stuurbeugel en de luxe zitting springen eruit. De CX is wat ons betreft het beste kindertransportsysteem ter wereld. Nieuw! Veilige trommelremmen. Snel rijden, veilg stoppen. Zonder enig risico voor uw kind. Dit dankzij de nieuwe trommelremmen bij de achterwielen. Door deze nieuwe innovatie kunt u altijd direct stoppen, waardoor u zelfs kunt skeeleren met uw Chariot! </p><p>CX 1 luxe uitrusting:</p><ul><li>Afneembaar getint zijvenster, met insectennet (klittenbandbevestiging) </li><li>Individueel instelbare bladvering </li><li>Lichte, refelecterende sportwielen </li><li>Gestoffeerde luxe schoudergordel </li><li>Uitneembare voetenruimtebedekking </li><li>Ergonomische stuurbeugel (5 posities) </li><li>Afneembare stuurtas </li><li>2-in-1 all-weather-dek </li><li>3M-Scotchlite reflectiebanden </li><li>Groot bagagevak </li><li>Extra tasje voor sleutels, telefoon etc. </li><li>Trommelremsysteem </li></ul><p>De CX1&nbsp;is uitgevoerd met diverse mogenlijkheden om de kar te optimaliseren voor verschillende weertype. Waarondern een gentint afneembaar zijvenster, 2-in-1 regendek en een extra groot zonnescherm. <br />Voor de veiligheid is de kar rondom voorzien van reflectie. De kar valt daardoor ook in avond uren op!<br />De bladvering zorgt voor een comfortabele rit, en is individueel instelbaar. De soepele vering is onderhousvrij en eenvoudig in gebruik.</p><p>Om de kar te gebruiken i.c.m. bijvoorbeeld de fiets of als wandelwagen dient u de daarvoor benodigde accessoires te bestellen. Zie daarvoor de accessoires rechts bovenaan.</p></div>', '', '739,00', 'AHWC76', 'AHWC76', -1, 'Kinderkarren');
INSERT INTO z_export (id, rootname, naam, variant, merk, omschrijving, nprijs, prijs, jnr, jnr2, aantal, groep) VALUES (1490, '49853', 'CX2', '', 'Chariot', '<div class="product_tekst"><p>De nieuwe CX1 en CX 2 zetten een nieuwe standaard. We hebben alleen de beste onderdelen gebruikt.<br />Vooral de vering, de verstelbare stuurbeugel en de luxe zitting springen eruit. De CX is wat ons betreft het beste kindertransportsysteem ter wereld. Nieuw! Veilige trommelremmen. Snel rijden, veilg stoppen. Zonder enig risico voor uw kind. Dit dankzij de nieuwe trommelremmen bij de achterwielen. Door deze nieuwe innovatie kunt u altijd direct stoppen, waardoor u zelfs kunt skeeleren met uw Chariot! </p><p>CX&nbsp;2 luxe uitrusting:</p><ul><li>Afneembaar getint zijvenster, met insectennet (klittenbandbevestiging) </li><li>Individueel instelbare bladvering </li><li>Lichte, refelecterende sportwielen </li><li>Gestoffeerde luxe schoudergordel </li><li>Uitneembare voetenruimtebedekking </li><li>Ergonomische stuurbeugel (5 posities) </li><li>Afneembare stuurtas </li><li>2-in-1 all-weather-dek </li><li>3M-Scotchlite reflectiebanden </li><li>Groot bagagevak </li><li>Extra tasje voor sleutels, telefoon etc. </li><li>Trommelremsysteem </li></ul><p>De CX2&nbsp;is uitgevoerd met diverse mogenlijkheden om de kar te optimaliseren voor verschillende weertype. Waarondern een gentint afneembaar zijvenster, 2-in-1 regendek en een extra groot zonnescherm. <br />Voor de veiligheid is de kar rondom voorzien van reflectie. De kar valt daardoor ook in avond uren op!<br />De bladvering zorgt voor een comfortabele rit, en is individueel instelbaar. De soepele vering is onderhousvrij en eenvoudig in gebruik.</p><p>Om de kar te gebruiken i.c.m. bijvoorbeeld de fiets of als wandelwagen dient u de daarvoor benodigde accessoires te bestellen. Zie daarvoor de accessoires rechts bovenaan.</p><p><table border="0" cellspacing="0" cellpadding="0"><tbody><tr><td class="variaties" colspan="6"><strong>Technische gegevens </strong></td></tr><tr><td width="150"><div class="groep_product">CX2</div><div class="groep_maattabel">Afmetingen L x B x H</div><div class="groep_maattabel">Zitbreedte</div><div class="groep_maattabel">Voetruimte</div><div class="groep_maattabel">Hoofdhoogte</div><div class="groep_maattabel">Gewicht</div><div class="groep_maattabel">Belasting</div><div class="groep_maattabel">Duwstang hoogte</div><div class="groep_maattabel">Zitplaatsen</div></td><td width="165"><div class="groep_product">Uitgevouwen </div><div class="groep_maattabel">92&nbsp;cm x&nbsp;82 cm x&nbsp;83 cm&nbsp;</div><div class="groep_maattabel">50 cm</div><div class="groep_maattabel">50 cm</div><div class="groep_maattabel">64,5 cm </div><div class="groep_maattabel">11,8 kg </div><div class="groep_maattabel">34&nbsp;kg </div><div class="groep_maattabel">97 cm / 102 cm</div><div class="groep_maattabel">2</div></td><td width="165"><div class="groep_product">Opgevouwen </div><div class="groep_maattabel">105 cm x&nbsp;79 cm x&nbsp;30 cm </div><div class="groep_maattabel">n.v.t. </div><div class="groep_maattabel">n.v.t. </div><div class="groep_maattabel">n.v.t. </div><div class="groep_maattabel">11,8&nbsp;kg </div><div class="groep_maattabel">n.v.t. </div><div class="groep_maattabel">n.v.t.</div><div class="groep_maattabel">n.v.t. </div></td></tr></tbody></table></p><p>&nbsp;</p></div>', '', '799,00', 'AHWC71', 'AHWC71', NULL, 'Kinderkarren');
