INSERT INTO z_export (id, rootname, naam, variant, merk, omschrijving, nprijs, prijs, jnr, jnr2, aantal, groep) VALUES (1496, '49879', 'Cyclone', '55-58CM Zwart/Chrome', 'Carrera', '<p>De Carrera Cyclone is geproduceerd met &ldquo;in-mold&rdquo; technologie, een innovatief systeem dat de binnen en buitenhelm samenvoegt. De voordelen zijn de verbeterde stevigheid van de helm, hogere impact absorptie, mogelijkheid voor meerdere ventilatie gaten en langer behoud van de kwaliteit van de helm. De helm is voorzien van een exclusief systeem voor het aanpassen van de maat, die gebruiker de mogelijkheid geeft om de helm zowel horizontaal als verticaal in te stellen zodat de helm iedereen altijd lekker zit. De Cyclone heeft grootte ventilatie gaten voor de toevoer van frisse lucht en de afvoer van warme lucht. </p><p>Eigenschappen <br />- In-Mold <br />- 19 ventilatiegaten (inclusief achter, luchtkanalen in de helm.) <br />- Total Fits System (TFS) horizontaal en vertikaal instelbaar <br />- Kinbescherming en snelsluiting</p>', '', '119,95', '20108', '20108', 1, 'Sport');
