INSERT INTO z_export (id, rootname, naam, variant, merk, omschrijving, nprijs, prijs, jnr, jnr2, aantal, groep) VALUES (1510, '49923', 'GPSMap 60CSX', '', 'Garmin', '<div class="product_tekst"><p>De GPSMAP 60CSx met ingebouwde SiRF ontvanger is overal en onder alle omstandigheden te gebruiken. Deze avontuurlijke metgezel is ideaal voor de vakantiefietser maar ook voor de dagtochten dichter bij huis.</p><p><strong>Kaarten</strong><br />Standaard is de GPSMAP 60CSx voorzien van een basis kaart van europa. U kunt voorgeprogrammeerde BlueChart en CityNavigator (microSD) geheugenkaartjes kopen of zelf gegevens downloaden van de standaard bijgeleverde Trip &amp; Waypointmanager CD-ROM. Het apparaat is geschikt voor 1000 waypoints, 50 routes en 1000 track(logs).</p><p><strong>Veelzijdig<br /></strong>Het is meer dan alleen navigatie tool, de GPSMAP 60CSx is voorzien van elektronisch kompas, barometrische hoogtemeter en een jacht/vis kalender. Daarnaast zorgt de waterdichte en stootvaste behuizing voor gebruiksgemak in alle hoeken van de wereld.</p><p>De Garmin functioneert op 2 AA batterijen en gaat hiermee 18 uur mee. Het 213 gram wegende apparaat is 61x155x33 mm groot en is voorzien van een 38 inch 256 kleuren TFT scherm. , stootvaste behuizing </p><p><strong>In de doos</strong> </p><ul><li>GPSMAP 60CSx </li><li>64 MB micro SD geheugenkaart </li><li>USB PC kabel </li><li>polsband </li><li>riemclip </li><li>Trip &amp; Waypoint manager PC Software </li><li>handboek en quick start guide</li></ul></div>', '', '349', '010-00422-01   ', '010-00422-01', 1, 'GPS Apparatuur');
INSERT INTO z_export (id, rootname, naam, variant, merk, omschrijving, nprijs, prijs, jnr, jnr2, aantal, groep) VALUES (1511, '49924', 'Edge 605', '', 'Garmin', '<p>De Edge 605 is special ontworpen voor de racefietser waarbij mede is gelet op vorm en functionaliteit. Door gevoelige GPS ontvanger functioneert het apparaat onder alle omstandigheden. Het model houdt nauwkeurig snelheid, afstand en tijd bij, alsmede allerlei hieruit af te leiden randgegevens.<br /><br /><strong>Kaarten<br /></strong>Met de Edge 605 is het mogelijk optionele kaarten te gebruiken voor het berekenen van routes, en d.m.v. apparaat-naar-apparaat communicatie het onderling delen van routes, trainingen, koersen, tracks en waypoints. De SRM techniek wordt veel gebruikt door echte professionals en stelt u in staat de direct op de pedalen uitgeoefende kracht te meten.<br /><br />De Edge 605 heeft een acculevensduur van 15 uur, een kleurenscherm, via microSD uitbreidbaar geheugen voor het opslaan van cartografie en een intern geheugen van 495 MB. Het 104,9 gram wegende apparaat is 51x109x25 mm groot. </p><p>Garmin ConnectTM stelt u in staat alle gegevens en prestaties grafisch op uw scherm weer te geven. Alle informatie zoals snelheid, hartslag, cadans, hoogte en tempo, kan gelijktijdig of afzonderlijk in beeld worden gebracht. Daarnaast is het mogelijk routes en tracks in Google Earth te bekijken, zodat u vooraf een goed beeld heeft van de zwaarte van het uitgezette parcours of achteraf kunt nakijken waarom uw hartslag relatief hoog was op een bepaald punt in dat parcours.</p><p><strong>In de doos</strong></p><ul><li><p>Edge 605</p></li><li><p>netlader </p></li><li>USB interfacekabel </li><li>fietsstuursteun </li><li>handboek<br /></li></ul>', '', '359', '010-00555-01   ', '010-00555-01', 1, 'GPS Apparatuur');
INSERT INTO z_export (id, rootname, naam, variant, merk, omschrijving, nprijs, prijs, jnr, jnr2, aantal, groep) VALUES (1512, '49925', 'Edge 705 Bundel', '', 'Garmin', '<div class="product_tekst"><p>De Edge 705 is special ontworpen voor de racefietser waarbij mede is gelet op vorm en functionaliteit. Alle modellen zijn voorzien van een uiterst gevoelige GPS ontvanger. Alle modellen houden nauwkeurig snelheid, afstand en tijd bij, alsmede allerlei hieruit af te leiden randgegevens. </p><p><strong>Kaarten<br /></strong>Met de Edge 705 is het mogelijk optionele kaarten te gebruiken voor het berekenen van routes, en d.m.v. apparaat-naar-apparaat communicatie het onderling delen van routes, trainingen, koersen, tracks en waypoints. De SRM techniek wordt veel gebruikt door echte professionals en stelt u in staat de direct op de pedalen uitgeoefende kracht te meten. </p><p>De Edge 705 heeft een acculevensduur van 15 uur, een kleurenscherm, via microSD uitbreidbaar geheugen voor het opslaan van cartografie en een intern geheugen van 495 MB. Het 104,9 gram wegende apparaat is 51x109x25 mm groot. </p><p><strong>Hartslag &amp; Cadans</strong><br />De Edge 705 is een uiterst geavanceerde fietstrainer en kan worden aangeschaft als Edge 705 HR (incl. hartslag sensor) en als Edge 705 Bundel (incl. hartslag- en cadanssensor). De cadanssensor is ook afzonderlijk te koop zodat gebruikers van de Edge 705HR in een later stadium alsnog beide functies kunnen gebruiken in hun training. De sensor gegevens worden met ANTTM technologie draadloos doorgegeven aan de Edge 705.</p><p>Garmin ConnectTM stelt u in staat alle gegevens en prestaties grafisch op uw scherm weer te geven. Alle informatie zoals snelheid, hartslag, cadans, hoogte en tempo, kan gelijktijdig of afzonderlijk in beeld worden gebracht. Daarnaast is het mogelijk routes en tracks in Google Earth te bekijken.</p><p><strong>In de doos</strong></p><ul><li>Edge 705 </li><li>hartslagsensor </li><li>cadanssensor </li><li>netlader </li><li>USB interfacekabel </li><li>fietsstuursteun </li><li>handboek </li></ul></div>', '', '499', '010-00555-31   ', '010-00555-31', 2, 'GPS Apparatuur');
INSERT INTO z_export (id, rootname, naam, variant, merk, omschrijving, nprijs, prijs, jnr, jnr2, aantal, groep) VALUES (1513, '49926', 'Etrex Legend Hcx', '', 'Garmin', '<p>De eTrex Legend HCx is een veelzijdige en compacte handheld GPS navigator met cartografie weergave. Deze herziene uitgave beschikt als extra over een hoog gevoelige GPS ontvanger voor verbeterde ontvangst in moeilijke omstandigheden zoals bossen en stedelijke gebieden.</p><p>De eTrex heeft een helder, in zonlicht afleesbaar, 256 kleuren TFT kleurenscherm en is voorzien van een micro SD geheugenslot voor opslag van optionele detailkaarten. Het 156 gram wegende apparaat is 56x107x30 mm groot. </p><p><strong>Kaarten<br /></strong>Standaard is de eTrex Legend voorzien van een basis kaart van europa. U kunt voorgeprogrammeerde BlueChart en CityNavigator (microSD) geheugenkaartjes kopen of zelf gegevens downloaden van de standaard bijgeleverde Trip &amp; Waypointmanager CD-ROM. Het apparaat is geschikt voor 1000 waypoints, 50 routes en 10.000 track(logs).</p><p>Het apparaat, mede door de waterdichtheid volgens de IPX7 norm, uitermate geschikt voor de buiten- en watersport.</p><p><strong>In de doos</strong></p><ul><li>eTrex Legend HCx </li><li>USB Interface kabel </li><li>fietsstuursteun adapter </li><li>Mapsource Trip &amp; Waypoint Manager CD </li><li>polsband </li><li>handboek</li></ul>', '', '199', '010-00629-01   ', '010-00629-01', 2, 'GPS Apparatuur');
INSERT INTO z_export (id, rootname, naam, variant, merk, omschrijving, nprijs, prijs, jnr, jnr2, aantal, groep) VALUES (1514, '49927', 'Etrex Vista Hcx', '', 'Garmin', '<p>De eTrex Vista HCx is een veelzijdige en compacte handheld GPS navigator met cartografie weergave. Deze herziene uitgave beschikt als extra over een hoog gevoelige GPS ontvanger voor verbeterde ontvangst in moeilijke omstandigheden zoals bossen en stedelijke gebieden.</p><p>De etrex heeft een helder, in zonlicht afleesbaar, 256 kleuren TFT kleurenscherm en is voorzien van een micro SD geheugenslot voor opslag van optionele detailkaarten. Het 156 gram wegende apparaat is 56x107x30 mm groot. </p><p><strong>Kaarten<br /></strong>Standaard is de eTrex Vista voorzien van een basis kaart van europa. U kunt voorgeprogrammeerde BlueChart en CityNavigator (microSD) geheugenkaartjes kopen of zelf gegevens downloaden van de standaard bijgeleverde Trip &amp; Waypointmanager CD-ROM. Het apparaat is geschikt voor 1000 waypoints, 50 routes en 10.000 track(logs).</p><p><strong>Kompas &amp; Hoogtemeter<br /></strong>De Vista&nbsp;HCx is ten opzichte van de Legend HCx aanvullend voorzien van een luchtdruksensor en elektronisch kompas. Met de luchtdruk hoogtemeter kunnen uiterst nauwkeurige hoogtegegevens en verticale profielen worden vastgelegd. Het kompas bewijst z''n nut bij het nemen van zichtpeilingen en geeft tevens aan in welke richting u wijst als u stilstaat. Het apparaat is, mede door de waterdichtheid volgens de IPX7 norm, uitermate geschikt voor de buiten- en watersport.</p><p><strong>In de doos</strong></p><ul><li>eTrex Vista HCx </li><li>USB Interface kabel </li><li>fietsstuursteun adapter </li><li>Mapsource Trip &amp; Waypoint Manager CD </li><li>polsband </li><li>handboek<br /></li></ul>', '', '249', '010-00630-01   ', '010-00630-01', 1, 'GPS Apparatuur');
INSERT INTO z_export (id, rootname, naam, variant, merk, omschrijving, nprijs, prijs, jnr, jnr2, aantal, groep) VALUES (1515, '49928', 'Fietsstuursteun Etrex Serie', '', 'Garmin', '<div class="product_tekst">Complete montage set voor het monteren van Etrex op de fiets. Voor alle stuurdiamters.<br />Voor Etrex Serie </div>', '', '8,95', '010-10204-00   ', '010-10204-00', 1, 'GPS Accessoires');
INSERT INTO z_export (id, rootname, naam, variant, merk, omschrijving, nprijs, prijs, jnr, jnr2, aantal, groep) VALUES (1516, '49929', 'Worldmap', '', 'Garmin', '<p>Een relatief voordelige kaart, voorzien van steden vanaf 20.000 inwoners, met alle hoofd- en secundaire wegen. Een houvast voor snelle plaatsbepaling en navigatie overal ter wereld. Aanrader voor de avonturier die graag over de wereld reist.</p><p>Worldmap beschikt niet over autorouting.</p>', '', '85', '010-10215-01   ', '010-10215-01', 2, 'GPS Software');
INSERT INTO z_export (id, rootname, naam, variant, merk, omschrijving, nprijs, prijs, jnr, jnr2, aantal, groep) VALUES (1518, '49931', 'Fietsstuursteun GPSMAP 60Csx', '', 'Garmin', '<div class="product_tekst">Complete montage set voor het monteren van uw GPSMAP op de fiets. Gechikt voor alle stuurdiamters.<br />Voor 60 Serie </div>', '', '22,95', '010-10454-00   ', '010-10454-00', 2, 'GPS Accessoires');
INSERT INTO z_export (id, rootname, naam, variant, merk, omschrijving, nprijs, prijs, jnr, jnr2, aantal, groep) VALUES (1520, '50010', 'City Navigator NT', 'Europa CD-ROM', 'Garmin', '<p>Uiterst gedetaileerde wegenkaarten voor gebruik in een Garmin navigatie toestel. NT is de nieuwste compressietechniek zodat er minder beslag wordt gelegd op de geheugenruimte in het toestel.</p><p>De CD versie is bedoeld om eerst op uw PC te installeren, vervolgens kunt u de kaarten in uw Garmin toestel laden. Wenst u de kaarten direct in uw toestel te gebruiken zonder tussenkomst van de PC dan adviseren wij de Micro-SD versie</p>', '', '235,00', '010-10887-00', '010-10887-00', 2, 'GPS Software');
INSERT INTO z_export (id, rootname, naam, variant, merk, omschrijving, nprijs, prijs, jnr, jnr2, aantal, groep) VALUES (1520, '49933', 'City Navigator NT', 'Europa Micro SD', 'Garmin', '<p>Uiterst gedetaileerde wegenkaarten voor gebruik in een Garmin navigatie toestel. NT is de nieuwste compressietechniek zodat er minder beslag wordt gelegd op de geheugenruimte in het toestel.</p><p>De CD versie is bedoeld om eerst op uw PC te installeren, vervolgens kunt u de kaarten in uw Garmin toestel laden. Wenst u de kaarten direct in uw toestel te gebruiken zonder tussenkomst van de PC dan adviseren wij de Micro-SD versie</p>', '', '110,95', '010-10680-50   ', '010-10680-50', 1, 'GPS Software');
INSERT INTO z_export (id, rootname, naam, variant, merk, omschrijving, nprijs, prijs, jnr, jnr2, aantal, groep) VALUES (1522, '49935', 'Houder GPSMap 60CSX', '', 'RAM', '<div class="product_tekst"><p>Houder voor het monteren van een GPSMAP 60 serie product. </p><p><strong>Let&nbsp; op!<br /></strong>Voor montage op de fiets dient u Ram Unistuurhouder bij te bestellen<em>.</em></p></div>', '', '9,95', 'NIPHOLGA12U    ', 'NIPHOLGA12U', 1, 'GPS Accessoires');
INSERT INTO z_export (id, rootname, naam, variant, merk, omschrijving, nprijs, prijs, jnr, jnr2, aantal, groep) VALUES (1523, '49936', 'Unistuurhouder', '', 'RAM', '<div class="product_tekst"><p>Robuuste universele montagesteun voor op de fiets. Geschikt voor alle stuur diamters en veel stuurpennen. Ideaal voor op de mountainbike.</p><p><strong>Let op!<br /></strong>De&nbsp;Unistuurhouder&nbsp;alleen is niet voldoende voor de montage van een Garmin. U dient nog een aparte houder bij te bestellen. Bijvoorbeeld de Ram houder voor de GPSMAP 60 Csx.</p></div>', '', '31,95', 'NPIB149ZAU     ', 'NPIB149ZAU', 0, 'GPS Accessoires');
INSERT INTO z_export (id, rootname, naam, variant, merk, omschrijving, nprijs, prijs, jnr, jnr2, aantal, groep) VALUES (1524, '49937', 'Topo Duitsland', '', 'Garmin', '<div class="product_tekst">De topografische kaarten worden in het algemeen per land ontwikkeld door de lokale importeur. Deze kaarten geven informatie over wandelpaden, hoogtes, vegitatie en in enkele gevallen zelfs over hoogspanningskabels. De kaarten zijn dus een waardevolle aanvulling voor de buitensporter. <br />Duitsland </div>', '', '199', 'SAI7500403     ', 'SAI7500403', 1, 'GPS Software');
INSERT INTO z_export (id, rootname, naam, variant, merk, omschrijving, nprijs, prijs, jnr, jnr2, aantal, groep) VALUES (1525, '49938', 'Topo Belgie', '', 'Garmin', 'De topografische kaarten worden in het algemeen per land ontwikkeld door de lokale importeur. Deze kaarten geven informatie over wandelpaden, hoogtes, vegitatie en in enkele gevallen zelfs over hoogspanningskabels. De kaarten zijn dus een waardevolle aanvulling voor de buitensporter. <br />Belgie', '', '99', 'SAI7500405     ', 'SAI7500405', 4, 'GPS Software');
INSERT INTO z_export (id, rootname, naam, variant, merk, omschrijving, nprijs, prijs, jnr, jnr2, aantal, groep) VALUES (1526, '49939', 'Fiets & Wandelkaart Belgie & Luxemburg', '', 'Garmin', '<div class="product_tekst"><p>De Routeplanner voor fietsers en wandelaars in Belgi&euml; en in het Groot-Hertogdom Luxemburg laat toe een route te bepalen op een computer waardoor de gebruiker begeleid wordt bij voorkeur langs fiets- en/of wandelvriendelijke wegen. De gebruiker kan nadien de berekende route overdragen naar een Garmin GPS toestel dat hem zal leiden volgens deze route. </p><p>De routeplanner werkt ook op de GPS zelf: voer een bestemming in op de GPS en hij zal u leiden naar deze bestemming bij voorkeur langs Fiets- en/of wandelvriendelijke wegen, net als een GPS die in de wagen op weg helpt langs autosnelwegen.</p><p>(CD-ROM)</p>Belgie&nbsp;+ Luxemburg </div>', '', '79', 'SAI7500407     ', 'SAI7500407', 2, 'GPS Software');
INSERT INTO z_export (id, rootname, naam, variant, merk, omschrijving, nprijs, prijs, jnr, jnr2, aantal, groep) VALUES (1527, '49940', 'Topo Nederland', 'CD-ROM', 'Garmin', 'Topo Nederland kan worden gebruikt in alle Garmin GPSen die geschikt zijn voor weergave van MapSource cartografie. Dit product is speciaal ontwikkeld voor fietsers en wandelaars. Deze doelgroep vindt dan ook veel informatie die voor hun van belang is tijdens hun activiteiten. Denk hierbij aan bijvoorbeeld fiets- en wandelpaden, hoogtelijnen en informatie over vegetatie. Daarnaast is informatie over waterwegen en hoogspanningsleidingen opgenomen in het kaartmateriaal. Ook voor kano- en ballonvaarders is Topo Nederland dus een waardevolle toevoeging. Topo Nederland vermeldt geen straatnamen. <p>De CD versie is bedoeld om eerst op uw PC te installeren, vervolgens kunt u de kaarten in uw Garmin toestel laden. Wenst u de kaarten direct in uw toestel te gebruiken zonder tussenkomst van de PC dan adviseren wij de Micro-SD versie.</p>', '', '135,00', 'SAI7500420     ', 'SAI7500420', 1, 'GPS Software');
INSERT INTO z_export (id, rootname, naam, variant, merk, omschrijving, nprijs, prijs, jnr, jnr2, aantal, groep) VALUES (1527, '50011', 'Topo Nederland', 'Micro(SD)', 'Garmin', 'Topo Nederland kan worden gebruikt in alle Garmin GPSen die geschikt zijn voor weergave van MapSource cartografie. Dit product is speciaal ontwikkeld voor fietsers en wandelaars. Deze doelgroep vindt dan ook veel informatie die voor hun van belang is tijdens hun activiteiten. Denk hierbij aan bijvoorbeeld fiets- en wandelpaden, hoogtelijnen en informatie over vegetatie. Daarnaast is informatie over waterwegen en hoogspanningsleidingen opgenomen in het kaartmateriaal. Ook voor kano- en ballonvaarders is Topo Nederland dus een waardevolle toevoeging. Topo Nederland vermeldt geen straatnamen. <p>De CD versie is bedoeld om eerst op uw PC te installeren, vervolgens kunt u de kaarten in uw Garmin toestel laden. Wenst u de kaarten direct in uw toestel te gebruiken zonder tussenkomst van de PC dan adviseren wij de Micro-SD versie.</p>', '', '99,00', 'SAI7500425', 'SAI7500425', 1, 'GPS Software');
INSERT INTO z_export (id, rootname, naam, variant, merk, omschrijving, nprijs, prijs, jnr, jnr2, aantal, groep) VALUES (1528, '49941', 'Onroute Fietskaart Nederland', 'Micro SD', 'Garmin', '<p>Garmin heeft speciaal voor de fietser nieuwe software laten ontwikkelen. Dit is de oplossing waar de recreatieve fietser naar op zoek was zegt bijvoorbeeld de ANWB. </p><p>Het werkt echt heel simpel, je stopt een SD kaartje in je Garmin, plaatst dit op een fietssteun en je voert je bestemming in. Het resultaat is dat je navigatietoestel een mooie route voor je uitrekent en je net als in de auto wordt begeleid naar je bestemming doormiddel van&nbsp;geluid en een kaart. Eigenlijk net zo simpel als in de auto! </p><p>Garmin heeft goed gekeken naar de wensen van de recreatieve fietser, in tegenstelling tot de automobilist is deze fietser niet op zoek naar de snelste route maar naar een mooie route. Het systeem geeft voorkeur aan mooie wegen en aan de echte fietspaden, ook al moet je hier voor omrijden. Hiervoor is 41.000 kilometer aan mooie fietsroutes en maar liefst 5.400 kilometer aan echte fietspaden aanwezig op de SD kaart. </p><p>Aan veiligheid is natuurlijk ook gedacht, alle snelwegen en N-wegen (provinciale wegen) worden door de fietskaart als verboden gebied beschouwd. Op de kaart zijn meer dan 100.000 POI''s (points of interest, of wel noemenswaardige zaken) te vinden, erg handig als je bijvoorbeeld tijdens je fietstocht trek krijgt in een heerlijke pannenkoek. </p><p>De CD versie is vooral geschikt voor de Outdoormodellen. De SD versie voor o.a. de Nuvi modellen.</p>', '', '89,95', 'SAI7500520     ', 'SAI7500520', 1, 'GPS Software');
