INSERT INTO z_export (id, rootname, naam, variant, merk, omschrijving, nprijs, prijs, jnr, jnr2, aantal, groep) VALUES (1537, '50012', 'Edge 705 HR', '', 'Garmin', '<p>De Edge 705 is special ontworpen voor de racefietser waarbij mede is gelet op vorm en functionaliteit. Alle modellen zijn voorzien van een uiterst gevoelige GPS ontvanger. Alle modellen houden nauwkeurig snelheid, afstand en tijd bij, alsmede allerlei hieruit af te leiden randgegevens. </p><p><strong>Kaarten<br /></strong>Met de Edge 705 is het mogelijk optionele kaarten te gebruiken voor het berekenen van routes, en d.m.v. apparaat-naar-apparaat communicatie het onderling delen van routes, trainingen, koersen, tracks en waypoints. De SRM techniek wordt veel gebruikt door echte professionals en stelt u in staat de direct op de pedalen uitgeoefende kracht te meten. </p><p>De Edge 705 heeft een acculevensduur van 15 uur, een kleurenscherm, via microSD uitbreidbaar geheugen voor het opslaan van cartografie en een intern geheugen van 495 MB. Het 104,9 gram wegende apparaat is 51x109x25 mm groot. </p><p><strong>Hartslag &amp; Cadans</strong><br />De Edge 705 is een uiterst geavanceerde fietstrainer en kan worden aangeschaft als Edge 705 HR (incl. hartslag sensor) en als Edge 705 Bundel (incl. hartslag- en cadanssensor). De cadanssensor is ook afzonderlijk te koop zodat gebruikers van de Edge 705HR in een later stadium alsnog beide functies kunnen gebruiken in hun training. De sensor gegevens worden met ANTTM technologie draadloos doorgegeven aan de Edge 705.</p><p>Garmin&nbsp;ConnectTM stelt u in staat alle gegevens en prestaties grafisch op uw scherm weer te geven. Alle informatie zoals snelheid, hartslag, cadans, hoogte en tempo, kan gelijktijdig of afzonderlijk in beeld worden gebracht. Daarnaast is het mogelijk routes en tracks in Google Earth te bekijken.</p><p><strong>In de doos</strong></p><ul><li>Edge 705 </li><li>hartslagsensor </li><li>netlader </li><li>USB interfacekabel </li><li>fietsstuursteun </li><li>handboek </li></ul>', '', '459,00', '010-00555-21', '010-00555-21', 1, 'GPS Apparatuur');
