INSERT INTO z_export (id, rootname, naam, variant, merk, omschrijving, nprijs, prijs, jnr, jnr2, aantal, groep) VALUES (1550, '50121', 'Energy Gel', 'Citroen 100 Gram                        ', 'Maxim', '<div class="product_tekst">Koolhydraten zijn de belangrijkste energiebron bij duursport. Helaas is de koolhydraatvoorraad in de spieren (ook wel glycogeen genoemd) beperkt. Een depletie van je glycogeenvoorraad kan je prestatie met 50% doen dalen. <br /><br />Maxim Energy Gel is een hoog geconcentreerde koolhydratengel met vooral snelle koolhydraten. Dit verzekert je van een snelle koolhydraatopname wanneer je het echt nodig hebt.<br /><br />Functionele ingredienten:&nbsp;<br /><br />Maxim Energy Gel Orange bevat zowel guarana (cafe&iuml;nebevattende plant) als cafe&iuml;ne. Cafe&iuml;ne kan vermoeidheid uitstellen, reactietijd verkorten, alertheid verhogen en spierkracht vergroten. <br /><br /><strong>Gebruik:</strong><br />Tijdens de inspanning:<br />Vul tijdens het sporten je verbruikte energie aan met Maxim&nbsp;Energy Gel. Afhankelijk van de intensiteit, gebruik 25&ndash;33 g gel per 20-30 minuten om je bloedsuikerspiegel op peil te houden. Spoel weg met een paar slokken water of&nbsp;Maxim&nbsp;Energy Drink.<br /><br /><strong>Producteigenschappen </strong><br />&bull; bevat 300 kcal per 100 g <br />&bull; 74 g koolhydraten per 100 g <br />&bull; 3 smaken <br />&bull; hersluitbare pouch of single serve </div>', '', '2,99', 'MX8700061      ', 'MX8700061', 57041, 'Voeding');
