INSERT INTO z_export (id, rootname, naam, variant, merk, omschrijving, nprijs, prijs, jnr, jnr2, aantal, groep) VALUES (1585, '50229', 'Exowind', 'Impactx Photochromic Red-Black Gloss Frame', 'Rudy Project', 'De Rudy Project Exowind houdt Rudy Project kwaliteit betaalbaar. Standaard voorzien van, instelbare neusrubbers, verwisselbare lenzen en de mogelijkheid voor een RX adapter (Clip-On met geslepen glazen). <p>Impact-X is de meest geavanceerde lens technologie die op dit moment vrijgbaar is. Sinds de introductie van de CR-39 en Policarbonaat lenzen 40 jaar geleden is er nog nooit zo een voorruitgang geboekt. Impact-X kenmerkt zich door een aantal belangrijke eigenschappen.</p>
