INSERT INTO z_export (id, rootname, naam, variant, merk, omschrijving, nprijs, prijs, jnr, jnr2, aantal, groep) VALUES (1591, '50238', 'Strada (Draadloos)', '', 'Cateye', '<p>Strak, ligt gewicht en elegant, Cateye perfectioneert het design van een fietscomputer met de Strada. Laat het slanke design u niet misleiden, de Strada heeft het grootste display en lettertype uit zijn klasse en alle functies die u nodig heeft. De Strada monteert handig en snel op praktische iedere fiets. <br />De Strada is draadloos, met draad of met cadans meter verkrijgbaar.</p><p><strong>Functies</strong></p><ul><li>Actuele snelheid </li><li>Maximum snelheid </li><li>Gemiddelde snelheid </li><li>Odometer (Totaal afstand) </li><li>Dag afstand teller </li><li>Tijd over dag afstand </li><li>Dag afstand teller 2 </li><li>Klok</li></ul>', '', '89,95', '678805', '678805', 4, 'Fietscomputers');
INSERT INTO z_export (id, rootname, naam, variant, merk, omschrijving, nprijs, prijs, jnr, jnr2, aantal, groep) VALUES (1592, '50239', 'Vectra (Draadloos)', '', 'Cateye', '', '', '42,95', '672036', '672036', 5, 'Fietscomputers');
INSERT INTO z_export (id, rootname, naam, variant, merk, omschrijving, nprijs, prijs, jnr, jnr2, aantal, groep) VALUES (1593, '50240', 'Velo 5', '', 'Cateye', 'De&nbsp;Velo 5&nbsp;is het instapmodel van Cateye. Door het grote scherm en een grote knop is de Velo 5 heel gebruiksvriendelijk. Zoals alle Cateye computers is de Velo 5 ook supersonische gelast, waardoor de computers tegen elke weersomstandigheden kunnen. De universele draadset kan op bijna alle vorken en sturen bevestigd worden <br /><br /><strong>Functions</strong><br /><ul><li>Huidige afstand </li><li>Maximale snelheid </li><li>Totale afstand </li><li>Ritafstand </li><li>Maximale afstand </li><li>Klok </li></ul>', '', '16,95', '675405', '675405', 8, 'Fietscomputers');
INSERT INTO z_export (id, rootname, naam, variant, merk, omschrijving, nprijs, prijs, jnr, jnr2, aantal, groep) VALUES (1594, '50242', 'Velo 8', 'Zilver', 'Cateye', 'Computer met dubbele display en de volgende functies:<br />snelheid, dag-afstand, totale afstand, gemiddelde, max snelheid, gereden tijd, calorie verbruik, klok.', '', '20,95', '676063', '676063', 26, 'Fietscomputers');
