INSERT INTO z_export (id, rootname, naam, variant, merk, omschrijving, nprijs, prijs, jnr, jnr2, aantal, groep) VALUES (1636, '50289', 'Cycle Motion Stand', '', 'Tacx', 'Ideale montagestandaard voor de zwaardere werkzaamheden. Uitgevoerd met verplaatsbaar montageblad. De fiets wordt gefixeerd aan de voor- of achtervork en staat stevig op een kunststof bracketsteun. De vorkhouders zijn zowel in hoogte als in lengte verschuifbaar. Geschikt voor racefietsen en mountainbikes met een wieldiameter van 24 t/m 28 inch.', '', '95,00', '521960', '521960', 2, 'Montagestandaards');
INSERT INTO z_export (id, rootname, naam, variant, merk, omschrijving, nprijs, prijs, jnr, jnr2, aantal, groep) VALUES (1637, '50290', 'Cycle Spider Prof', '', 'Tacx', 'De absolute topper onder de montagestandaards. Uitgeklapt een mobiele werkplaats; ingeklapt neemt de Spider Prof weinig plaats in. Is licht-in-gewicht door de vele aluminium onderdelen. Het driepootstatief staat stevig op de grond. Zware werkzaamheden voer je er probleemloos op uit. De in hoogte verstelbare standaard kan in z''n geheel rondgedraaid en gekanteld worden waardoor het sleutelen aan de fiets nog makkelijker wordt. Geschikt voor vrijwel alle fietsen met een framebuisdiameter tot 50 mm', '', '195,00', '521962', '521962', 2, 'Montagestandaards');
INSERT INTO z_export (id, rootname, naam, variant, merk, omschrijving, nprijs, prijs, jnr, jnr2, aantal, groep) VALUES (1638, '50291', 'Cycle Stand', '', 'Tacx', 'Inklapbare montagestandaard voor kleine en simpele reparaties. De hele fiets kantel je eenvoudig naar voren; bijzonder handig voor het sleutelen aan het balhoofd en het stuur. De Cyclestand is voorzien van een verschuifbaar montageblad en voorwielgeleiders die ervoor zorgen dat het stuur niet omklapt. Geschikt voor alle fietsen.', '', '89,00', '521961', '521961', 2, 'Montagestandaards');
INSERT INTO z_export (id, rootname, naam, variant, merk, omschrijving, nprijs, prijs, jnr, jnr2, aantal, groep) VALUES (1639, '50292', 'Freewheel Reiniger', '', 'Tacx', '', '', '2,80', '8714895011820', '8714895011820', 7, 'Gereedschap');
INSERT INTO z_export (id, rootname, naam, variant, merk, omschrijving, nprijs, prijs, jnr, jnr2, aantal, groep) VALUES (1640, '50293', 'Bladboutsleutel', 'T4465                                   ', 'Tacx', 'Voor het los- en vastdraaien van de borgmoer van het kettingblad van Shimano XTR, XT, LX en STX-RC crankstellen. De fixeeras zorgt er voor dat losschieten tijdens gebruik is uitgesloten. De sleutel M15x1 kan tevens worden gebruikt als bracketas sleutel voor de XTR bracketas.', '', '4,95', '521521', '521521', 5, 'Gereedschap');
INSERT INTO z_export (id, rootname, naam, variant, merk, omschrijving, nprijs, prijs, jnr, jnr2, aantal, groep) VALUES (1641, '50296', 'Kettingpons', '3/32 T3210', 'Tacx', 'Tacx Kettingpons, met opbergruimte voor schakels. IJzersterke constructie, heeft een onbreekbaar ponspuntje om de pin door de schakel te drukken. De Tacx kettingpons fixeert de ketting tijdens het ponsen op twee schakels, verschuiven van de ketting is hierdoor praktisch onmogelijk.', '', '9,95', '521501', '521501', 9, 'Gereedschap');
